INSERT INTO `direksi` VALUES ('1', null, 'Satriyo Yudiarto', '<p>Lahir pada tahun 1947 di Majenang dengan kewarganegaraan Indonesia. Meraih lulusan terbaik dari Sekolah Tinggi Ilmu Perbankan (STIKUBANK) pada tahun 1971. Beliau memulai karirnya di <em>The Bank of Tokyo</em>, Ltd pada tahun 1972-2000 dan mencapai puncak karir sebagai <em>Senior Assistant General Manager</em> dan merangkap sebagai <em>Senior Operation Manager</em>.</p><p>Saat ini Satriyo Yudiarto menjabat sebagai Komisaris Utama Surya Yudha Park/ Hotel, dan Komisaris Utama PT Kusuma Agung Sejahtera (Pemilik Hotel Santika Purwokerto). Satriyo Yudiarto juga merupakan Pemegang Saham Pengendali Perseroan dari PT BPR Surya Yudhakencana.&nbsp;<br />Beliau pensiun sebagai Komisaris Utama&nbsp;PT. BPR Surya Yudhakencana Banjarnegara terhitung sejak 20 Februari 2018 (1992-2018) dan PT. BPR Surya Yudha Wonosobo per tanggal 13 Maret 2018 (1997-2018).</p>', '20180220130734_Satriyo_Y_Komisaris_2.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('2', null, 'Milla Feryanti Yudianingsih', '<p>Memiliki latar belakang pendidikan Fakultas Ekonomi Jurusan Manajemen di Universitas Airlangga Surabaya dan Fakultas Sastra Jurusan Bahasa Jepang di Universitas Indonesia dengan meraih lulusan terbaik sehingga mendapat beasiswa untuk belajar di Universitas Soka, Tokyo, Jepang. Beliau kemudian melanjutkan pendidikannya di bidang Manajemen Bisnis di Sydney, Australia dan sempat menuntut ilmu di <em>Boulder Institute of Microfinance</em> di Turin-Italia atas beasiswa dari <em>MasterCard Foundation</em>.</p><p>Memiliki pengalaman kerja di <em>The Industrial Bank of Japan</em>, Jakarta selama 6 tahun dan Bank Mizuho Indonesia selama 5.5 tahun sebagai Sekretaris Direksi WN Jepang (<em>Ekspatriat</em>), Bagian <em>Business Development</em>/ <em>Marketing</em> dan juga bagian <em>General Affairs</em> (Umum).&nbsp;</p><p>&nbsp;</p><p>Saat ini Milla Feryanti aktif dalam kepengurusan beberapa organisasi, diantaranya sebagai Ketua Komite Tetap Perbankan KADIN Jakarta Barat, Ketua kompartemen Koperasi BPD HIPMI Jaya (Himpunan Pengusaha Muda&nbsp; Indonesia), Dept. Hub. Luar Negeri DPP Perbarindo (Perhimpunan BPR se-Indonesia), BOD IMA (Indonesia <em>Microfinance Association</em>), <em>National Vice President</em> dari <em>Junior Chamber International</em> (JCI) Indonesia-Jakarta yang merupakan Organisasi Kewirausahaan dan Pemimpin-pemimpin Muda Dunia dan aktif pula di beberapa kepengurusan organisasi pengusaha lainnya. Sempat terpilih oleh AusAid/ Pemerintah Australia untuk mewakili Indonesia dalam ajang <em>Asia Microfinance</em> Forum di Colombo-Srilanka. Di tahun 2011 Milla Feryanti terpilih sebagai finalis Tokoh Pengusaha Muda Indonesia yang diselenggarakan oleh HIPMI (Himpunan Pengusaha Muda Indonesia).</p>', '20180307081557_Ibu_Milla.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('3', null, 'Ananta Yudha Irianto', '<p>Berstatus sebagai Pilot lulusan dari <em>Australian Aviation College Adelaide</em>, Australia melalui beasiswa penuh dari Merpati Nusantara Airlines dan Dinas Perhubungan. Beliau pernah bekerja di Merpati Nusantara Airlines selama 10 tahun yang diselingi kontrak selama 2 tahun di Pelita Air dengan rating pesawat Fokker 28 sebagai <em>First Officer</em> (FO), Bar 3.</p><p>&nbsp;Saat ini bekerja di Lion Air dengan <em>rating </em>pesawat MD 82 dan MD 90 sebagai Captain Pilot, Bar 4. Beliau pernah mengambil studi di STAN (Sekolah Tinggi Akuntansi Negara) dan Fakultas Ekonomi Universitas Terbuka, namun lebih memilih untuk mengambil beasiswa penuh pendidikan Pilot di <em>Adelaide</em>, Australia. Beliau pernah memenangkan Kejuaraan Tenis Remaja se-Jawa Timur dan hingga saat ini tetap aktif bermain Tennis Lapangan, baik sebagai hobi maupun prestasi.</p>', '20180220111122_Ananta.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('4', null, 'Tenny Yanutriana, MBA', '<p>Lahir pada tahun 1981 di Jakarta dengan kewarganegaraan Indonesia. Memiliki latarbelakang pendidikan Fakultas Ilmu Sosial dan Ilmu Politik (FISIP) di Universitas Indonesia pada tahun 2004. Mendapatkan gelar <em>Master of Business Administration</em> (MBA) di Universitas Gadjah Mada Yogyakarta sebagai lulusan terbaik, dan menjalani satu semester <em>abroad di Fachhochschule K&ouml;ln</em>, Jerman.&nbsp; Pada di tahun 2010, <em>The MasterCard Foun</em><em>d</em><em>ation</em> memberikan beasiswa kepada beliau untuk mengikuti pendidikan <em>Boulder Institute of Microfinance &ldquo;Microfinance Management&rdquo; concentration</em> di Turin Italia dan di tahun 2011 beasiswa untuk mengikuti pendidikan <em>Harvard Business School Executive Education &ldquo;Strategic Leadership for Microfinance.&rdquo;</em> Beliau merupakan satu-satu lulusan <em>iLab Entrepreneur Institute</em> yang berasal dari Indonesia pada tahun 2015.</p><p>Mengawali karirnya di BPR Bank Surya Yudha sebagai Kepala Divisi Non-Operasional II yang membawahi Divisi Pembukuan, Sekretariat dan Personalia. Kini Beliau menjabat sebagai Komisaris Utama di PT. BPR Surya Yudhakencana sejak 20 Februari 2018, dimana sebelumnya beliau menjabat sebagai Komisaris&nbsp;tahun 2005-2018. Selain itu, beliau juga menjabat sebagai Ketua Departemen Bidang Luar Negeri di DPP Perbarindo.<br /><br />Dasar pengangkatan pada Akte Notaris No. 175 tanggal 20 Februari 2018, masa jabatan berlaku hingga 20 Februari 2023.</p>', '20180220131103_Tenny_Y_Komisaris_2.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('5', null, 'Dra. Ec. Emila Hayati', '<p>Lahir pada tahun 1965 di Surabaya dengan kewarganegaraan Indonesia. Lulusan Universitas Katolik Widya Mandala Surabaya, Fakultas Ekonomi Jurusan Manajemen tahun 1989. Mengawali karirnya di Bank of Tokyo, Ltd Surabaya pada bagian Operasional tahun 1989-1993. Kemudian di Sanwa Indonesia Bank Jakarta pada bagian ekspor impor dan bagian operasional sebagai Supervisor tahun 1993-2001. Dan bergabung dengan BPR Bank Surya Yudha sebagai Kepala Divisi Non-Operasional II yang membawahi Divisi Pembukuan, Sekretariat dan Personalia. Kini beliau menjabat sebagai Komisaris di BPR Bank Surya Yudha sejak April 2010 dan juga merupakan Komisaris di BPR Surya Yudha Wonosobo. Dasar pengangkatan pada Akte Notaris No. 49 tanggal 08 Mei 2015, masa jabatan berlaku hingga 19 Maret 2020.</p>', '20180220131034_Emila_H_Komisaris_2.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('6', null, 'Margono, S.E.', '<p>Lahir pada tahun 1950 di Klaten dengan kewarganegaraan Indonesia. Memulai karir pada tahun 1975-1976 sebagai Kepala Unit Desa PT Bank Rakyat Indonesia. Kemudian tahun 1976-1999 bekerja di PT Bank Dagang Negara dengan jabatan tertinggi sebagai Assistant Relationship Manager Kredit Corporate di Cabang Surabaya Gentengkali. Setelah itu pada tahun 1999-2005 bergabung dengan Bank Mandiri dengan jabatan tertinggi sebagai Pemegang Kewenangan di Regional Risk Management VII Semarang. Kemudian pada tahun 2007-2011 beliau dikontrak oleh Lembaga Penjamin Simpanan (LPS) sebagai Ketua Tim Likuidasi PT BPR Anugerah Arta Niaga di Pati.&nbsp; Beliau bergabung dengan BPR Bank Surya Yudha pada bulan Juli 2013 sebagai Kepala Bagian Pendidikan yang kemudian mutasi menjadi Kepala Bagian Kepatuhan pada bulan September 2014. Pada bulan November 2014, beliau menjabat sebagai Kepala Divisi Kepatuhan. Dan kini, beliau diangkat sebagai Komisaris Independen sejak bulan November 2016. Dasar pengangkatan pada Akte Notaris No. 49 tanggal 03 November 2016, dengan masa jabatan berlaku hingga 26 September 2021.</p>', '20180220132202_Margono_Komisaris_2.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('7', null, 'Sugeng Riyanto, S.E', '<p>Lahir pada tahun 1974 di Banjarnegara dengan kewarganegaraan Indonesia. Meniti karir di BSY sejak tahun 1995-1997 sebagai <em>Staf Marketing</em> Cabang Karangkobar, tahun 1997-1999 sebagai Kepala Seksi, tahun 1999-2000 sebagai Wakil Kepala Cabang Mandiraja, tahun 2000-2002 sebagai Kepala Cabang Utama, tahun 2002-2006 sebagai Kepala Cabang Karangkobar, tahun 2006-2010 sebagai Wakil Kepala Divisi Kredit. Menjabat sebagai Kepala Wilayah I (2010-2015). Kini beliau menjabat sebagai Direktur Utama sejak Agustus 2015.</p><p>Dasar pengngkatan pada Akte Notaris No. 70 tanggal 07 Juli 2015, masa jabatan berlaku hingga 07 Juli 2020.</p>', '20180220131327_Sugeng_R.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('8', null, 'Dra. Ec. Sri Wahyu Utami, Ak', '<p>Lahir pada tahun 1965 di Surabaya dengan kewarganegaraan Indonesia. Lulusan Sekolah Tinggi Ilmu Ekonomi Indonesia (STIESIA) Surabaya tahun 1989 dan lulus pendidikan profesi akuntan di Universitas Jenderal Soedirman (UNSOED) pada tahun 2007. Memulai karirnya sebagai staf pengajar SMP PGRI 32 Surabaya tahun 1988-1989. Kemudian pada tahun 1989-1990 sebagai Auditor di Kantor Akuntan Publik Subandi Surabaya, tahun 1990 Applied Computer Management Indonesia, dan bekerja di PT BPR Artha Senapati Bangil Pasuruan Jawa Timur pada tahun 1990-1992. Bergabung dengan BPR Bank Surya Yudha sejak tahun 1992 sebagai Direktur Utama tahun 1992-1999 dan Direktur tahun 1999-2009. Kini beliau menjabat sebagai Direktur Umum sejak tahun 2009. Beliau kini juga menjabat sebagai Bendahara Perbarindo DPK Banyumas dimana sebelumnya pernah menjabat sebagai Bendahara di DPD Perbarindo Jawa Tengah.</p><p>Dasar pengangkatan pada Akte Notaris No. 46 tanggal 09 November 2014, masa jabatan berlaku hingga 09 November 2019.</p>', '20180220132017_Yayuk-Dirum.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('9', null, 'Abdul Khoir Maradika Putra, S.H', '<p>Lahir pada tahun 1971 di Jakarta dengan kewarganegaraan Indonesia. Lulusan Fakultas Hukum Universitas Wijaya Kusuma Purwokerto tahun 2002. Mengawali karir di BPR Pilar Niaga Jakarta sebagai Marketing pada tahun 1993-1994. Kemudian bergabung dengan BPR Bank Surya Yudha pada tahun 1994-1997 sebagai Staf Marketing, tahun 1997-2001 sebagai Kepala Cabang Karangkobar, tahun 2001-2008 sebagai Wakil Kepala Divisi Kredit, tahun 2008-2009 sebagau Kepala Wilayah IV yang Cabang Purwokerto, Purbalingga, dan Klampok. Menjabat sebagai Direktur Kredit pada tahun 2009-2016. Kini beliau menjabat sebagai Komisaris Independen, dimana sebelumnya beliau menjabat sebagai&nbsp;Direktur Kepatuhan sejak November 2016 - 2018.<br /><strong>Dasar Pengangkatan</strong> pada Akte Notaris No. 175 tanggal 20 Februari 2018, masa jabatan berlaku hingga 20 Beruari 2023.</p>', '20180220131400_Abdul_Khoir_Dirkep.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('10', null, 'Achmad Supriyono, S.E.', '<p>Lahir pada tahun 1978 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi Universitas Wijaya Kusuma Purwokerto. Memulai karir pada tahun 1998-1999 sebagai staf TU MTS Muhammadiyah Petambakan Madukara Banjarnegara. Kemudian bergabung dengan BPR Bank Surya Yudha pada tahun 1999-2003 sebagai Marketing dan dipromosikan sebagai Kepala Seksi Kredit di Cabang Utama. Kemudian menjabat sebagai Kepala Seksi Kredit di Cabang Karangkobar (2003), Wakil Kepala Cabang Karangkobar (2004), Wakil Kepala Cabang Purbalingga (2005-2006), Kepala Kas Pasar Besar (2006),&nbsp; Kepala Cabang Karangkobar (2006-2008), Kepala Cabang batur (2008-2010), Kepala Cabang Purwokerto (2010-2012), Kepala Wilayah V (2012-2013), Kepala Divisi Kredit Wilayah V (2013), Kepala Wilayah V (2015), Kepala Wilayah VI (2015), dan Kepala Divisi Kredit (2016). Kini beliau telah diangkat menjadi Direktur Kredit, sejak bulan November 2016.<br />Dasar pengangkatan pada Akte Notaris No. 49 tanggal 03 November 2016, masa jabatan berlaku hingga 26 September 2021.</p>', '20180220132028_Aspri-Dirdit.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('11', null, 'Nurhadi, S.E.', '<p>Menjabat sebagai Kepala Divisi KKA&nbsp;berdasarkan SK No. 106/DIR/PRS/IV/18&nbsp;tanggal 13&nbsp;April&nbsp;2018. Lahir di Banyuwangi, 06 Mei 1967. Memiliki latar belakang pendidikan terakhir S1 Ekonomi di Universitas Jenderal Soedirman Purwokerto lulus pada tahun 2012. Bergabung dengan BSY pada bulan Februari 1997.</p>', '20180206125238_Nurhadi.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('12', null, 'Sutarjo, S.E', '<p>Lahir pada tahun 1973 di Banjarnegara, memiliki latar belakang pendidikan S1 Fakultas Ekonomi Universitas Jendral Soedirman Purwokerto. Sutarjo, S.E. merintis karir sebagai Staf Marketing mulai tanggal 13 Maret 1997 di BPR Bank Surya Yudha Banjarnegara Cabang Mandiraja. Pada bulan Mei 2003, Sutarjo, S.E. diangkat sebagai Kepala Kantor Kas Mandiraja. Kemudian pada bulan Mei 2006, Sutarjo, S.E. diangkat sebagai Wakil Kepala Cabang Purwonegoro. Pada bulan Agustus 2009, Sutarjo, S.E. dimutasi ke Kas Dieng Cabang Batur sebagai Ketua Pokja untuk persiapan kenaikan status menjadi Kantor Cabang. Namun pada tanggal 14 September 2009, Sutarjo, S.E. kembali dimutasi ke Cabang Purwonegoro sebagai Kepala Cabang dan saat ini Sutarjo, S.E dimutasi kembali ke Cabang Purwokerto mulai tanggal 02 Februari 2012. Pada tanggal 28 Juli 2016, beliau dimutasi ke Kantor Cabang Purbalingga sebagai Kepala Cabang. Pada tanggal 12 Mei 2017 dipromosikan sebagai Kepala Wilayah II yang membawahi Cabang Wanadadi, Cabang Purwonegoro, Cabang Mandiraja dan Cabang Klampok. Pada tanggal 22 Februari 2018 beliau dipercaya sebagai Kepala Wilayah III yang membawahi Cabang Karangkobar dan Cabang Kalibening. Pada tanggal&nbsp;13 April&nbsp;2018 beliau dipercaya sebagai Kepala Divisi Administrasi dan Pelaporan Kredit, Penyelesaian Kredit Bermasalah dan Legal &amp; Gugatan Sederhana (APL).</p>', '20180206125254_Sutarjo.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('13', null, 'Tisto Yuwono', '<p>Lahir pada tahun 1972 di Banjarnegara, berpendidikan terakhir lulusan SMA N 1 Banjarnegara dan lulus tahun 1992. Tidak melanjutkan ke Perguruan Tinggi karena mempunyai keinginan untuk langsung bekerja. Dan untuk lebih meningkatkan ketrampilan dan daya saing maka dikurun waktu tahun 1993 mengikuti berbagai pendidikan ketrampilan anatara lain computer, Bahasa Inggris dan mengetik. Setelah selesai mengikuti berbagai pendidikan non formal langsung merantau ke Jakarta dan diterima di Bank Papan Sejahtera Cabang Jakarta dan ditempatkan sebagai Staf Administrasi Kredit, bank tersebut ber alamat di Jl.HR.Rasuna Said dan merupakan bank yang bergerak khusus untuk pelemparan kredit Kepemilikan Rumah / KPR. Bekerja di Bank Papan Sejahtera dari tahun 1994 s/d 1996. Pada tahun 1997 kembali ke Banjarnegara dan pada akhirnya di bulan Juni 1999 mulai bergabung dengan Bank Surya Yudha Banjarnegara. Awal karir dimulai sebagai staf marketing di Pasar Banjarnegara dan tahun 2000 dimutasikan ke kantor Cabang Wanadadi kemudian di tahun 2005 dimutasikan ke Kantor Kas Singamerta. Pada tahun 2008 dipercaya menjabat sebagai Kepala Kantor Kas Singamerta, dan seiring dengan peningkatan status kantor Kas Singamerta menjadi kantor Cabang pada tahun 2009 dipercaya menjabat sebagai Wakil Kepala Cabang dan pada tahun 2010 dipromosikan sebagai Kepala Cabang Bank Surya Yudha Cabang Singamerta dan saat ini beliau dimutasikan ke Cabang Pekalongan sebagai Kepala Cabang per tanggal 01 Maret 2012. Pada tanggal 13 Juli 2016, dipromosikan menjadi Kepala Wilayah III yang membawahi Cabang Karangkobar dan Cabang Kalibening.</p>', '20180206125316_Tisto_Y.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('14', null, 'Eko Hartono, S.E', '<p>ahir pada tahun 1973 lahir di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi Universitas Jendral Soedirman Purwokerto. Eko Hartono, S.E. bergabung dengan BPR Bank Surya Yudha Banjarnegara pada tanggal 2 Desember 1996 Sebagai Staff Marketing di Cabang Wanadadi sampai dengan tanggal 1 Juni 1998. kemudian tanggal 1 Juni 1998 s/d 24 Maret 2003 sebagai staff marketing Cabang Utama Banjarnegara,&nbsp; Selanjutnya tanggal 25 Maret 2003 s/d 23 September 2003 Menjabat sebagai Kasi Kredit di Bagian PHBKIS. Tanggal 23 September 2003 s/d 8 Juli 2006 Mutasi Ke Cabang Utama Sebagai Kasie Kredit. Tanggal 8 Juli 2006 s/d 4 Februari 2008 Menjabat Sebagai Wakil Kepala Cabang Utama Banjarnegara. Tanggal 4 Februari 2008 s/d 30 Januari 2010 dimutasi ke Cabang Purwokerto Menjabat Wakil Kepala Cabang. Pada tanggal 30 Maret 2010 dimutasi ke Cabang Klampok sebagai Kepala Cabang. Beliau menjabat menjadi Kepala Cabang Singamerta per tanggal 17 Februari 2012. Pada tanggal 13 Juli 2016 dipromosikan menjadi Kepala Wilayah IV, yang membawahi Cabang Pagentan, Cabang Batur dan Cabang Dieng. Mulai tanggal 20 Februari 2018 beliau menjabat sebagai Kepala Wilayah I yang membawahi Cabang Utama, Cabang Pasar Besar, Cabang Singamerta dan Cabang Madukara.</p>', '20180206125417_Eko_H.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('15', null, 'Purnawan, S.E', '<p>Lahir pada tahun 1976 di Banjarnegara&nbsp;dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi Universitas Jenderal Soedirman Purwokerto. Purnawan, S.E. bergabung dengan&nbsp;BPR Bank Surya Yudha Cabang Karangkobar Kas Kalibening sebagai staf Marketing sejak 1997 hingga 2001, dengan kegigihan serta keuletan beliau di bulan Februari 2001 diangkat sebagai Kepala Seksi di Cabang Karangkobar Kas Kalibening, menjabat sebagai Kepala Cabang di &nbsp;Cabang Kalibening pun pernah beliau lakoni, hingga di awal bulan tahun 2007 beliau dipercaya untuk menjabat sebagai Kepala Cabang Kalibening, Di tahun 2011 ini beliau mencoba mengukir sejarah dengan mengepalai cabang baru di Pekalongan. Beliau dipromosikan menjadi Kepala Wilayah IV per tanggal 08 Maret 2012 dengan membawahi Cabang Kalibening dan Pekalongan. Pada tanggal 13 Juli 2016, beliau dipercaya menjadi Kepala Wilayah V yang membawahi Cabang Pekalongan.</p>', '20180206125526_Wawan_P.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('16', null, 'Wahyu Rukmono, S.E', '<p>Lahir pada tahun 1967 di Surabaya, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di Universitas Putra Bangsa Surabaya. Wahyu Rukmono, S.E. lahir di Surabaya tanggal 31 Maret 1967. Latar belakang pendidikan S1 fakultas ekonomi di Universitas Putra Bangsa Surabaya. Beliau pernah menjadi sales representative di PT Bina Swdya Surabaya pada tahun 1998 dan ditahun yang sama beliau pindah dan bekerja sebagai kolektor di PT. BPR Dau Anugrah Malang. Wahyu Rukmono, S.E. bergabung dengan PT. BPR Surya Yudha pada tahun 2000 dengan jabatan staf PPKB hingga tahun 2001. Dan pada tahun 2001 beliau dipromosikan menjadi Kepala Seksi PPKB hingga tahun 2002. Pada tahun 2003 beliau diangkat menjadi Kepala Cabang Utama PT. BPR Bank Surya Yudha. Pada tahun tersebut pula beliau dimutasikan ke Cabang Wanadadi dan menjabat sebagai Kepala Cabang hingga tahun 2006. Pada tahun 2006 beliau dimutasikan kembali menjadi Kepala Cabang Purwokerto. Dan pada tahun 2010 beliau diangkat menjadi Kepala Wilayah IV yang membawahi Cabang Purwokerto, Purbalingga dan Bobotsari. Namun karena adanya penataan ulang wilayah sehingga saat ini beliau menjabat menjadi Kepala Wilayah VI dengan membawahi Cabang Purwokerto dan Cilacap. Pada tanggal 16 November 2015, beliau dipercaya menjadi Kepala Wilayah V yang membawahi Cabang Purbalingga, Cabang Bobotsari dan Cabang Rembang. Pada Tanggal 13 Juli 2016, beliau dipercaya menjadi Kepala Wilayah VI yang membawahi Cabang Purbalingga, Cabang Rembang dan Cabang Bobotsari.<br />Terhitung per 20 Februari 2018, beliau mendapatkan amanah baru dari pemegang saham sebagai Direktur yang membawahkan Fungsi Kepatuhan.<br /><br />Dasar pengangkatan pada Akte Notaris No. 175 tanggal 20 Februari 2018, masa jabatan berlaku hingga 20 Februari 2023.</p>', '20180206125542_Nono.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('17', null, 'Gurita Nursetyawan, S.Hut.', '<p>Lahir pada tahun 1979 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1jurusan Kehutanan di INSTIPER Yogyakarta pada tahun 2003. Gurita Nursetyawan, S.Hut. bergabung di BPR Bank Surya Yudha mulai tanggal 10 Desember 2003 sebagai staff Marketing di Cabang Utama Kantor Pusat dan pada tahun 2007 dimutasikan ke Cabang Purwokerto. Meniti karir sebagai Kepala Kantor Kas Pabuaran sejak 2009 s.d 2012. Sebelum beliau menjabat Kepala Cabang Bobotsari seperti saat ini yang terhitung sejak 27 Agustus 2012, beliau menjabat sebagai Wakil Kepala Cabang Purwokerto selama 2 tahun dari Maret 2010 s.d Agustus 2012. Mulai bulan Maret 2014 beliau dimutasikan ke Cabang Cilacap sebagai Kepala Cabang. Pada tanggal 09 November 2015, beliau dipromosikan menjadi Kepala Wilayah III yang membawahi Cabang Karangkobar, Cabang Pagentan, Cabang Batur dan Cabang Dieng. Pada tanggal 13 Juli 2016, beliau dipercaya menjadi Kepala Wilayah VII, yang membawahi Cabang Purwokerto, dan Cabang Ajibarang.</p>', '20180206125555_gurita.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('18', null, 'Kondang, S.H', '<p>Lahir pada 1973 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Hukum di Universitas Wijaya Kusuma Purwokerto. Kondang, S.H. bergabung dengan BPR Bank Surya Yudha pada tahun 1995-2001 sebagai staf marketing Kantor Cabang Klampok. Beliau dipromosikan menjadi Kepala Seksi Kredit Cabang Klampok pada tahun 2001-2007. Beliau dipercaya menjadi Kepala Kantor Kas Susukan pada tahun 2007-2008. Pada 2008-2009, beliau dipercaya sebagai Wakil Kepala Cabang Purbalingga. Pada 2015, beliau dipercaya menjadi Kepala Cabang Banyumas. Dan pada tanggal 8 September 2017, beliau dipercaya menjadi Kepala Wilayah VIII hingga saat ini, yang membawahi Cabang Banyumas.</p>', '20180206125620_Kondang.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('19', null, 'Eling Sucipto, S.E', '<p>Lahir pada tahun 1971 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi Universitas Jendral Soedirman Purwokerto. Eling Sucipto, S.E. mulai bekerja tahun 1993 sebagai <em>Account Officer</em> (AO) di BPR Bank Surya Yudha Banjarnegara. Kemudian perjalanan karir lainnya yaitu, Pada tahun 2004 menjabat sebagai Wakil Kepala Cabang Purbalingga, tahun 2016 sebagai Wakil Kepala Cabang Klampok, tahun 2008 sebagai Kepala Cabang Wanadadi, tahun 2013 sebagai Kepala Cabang Purbalingga dan tahun 2016 beliau dipercaya menjabat sebagai Kepala Wilayah VIII, yang membawahi Cabang Cilacap dan Cabang Kroya. Sementara pada tanggal 9 September 2017, Wilayah VIII berubah menjadi Wilayah IX dengan membawahi cabang yang sama dan masih dipimpin oleh Eling Sucipto, S.E. Saat ini beliau menjabat sebagai Kepala Wilayah II yang membawahi Cabang Wanadadi, Cabang Purwonegoro, Cabang Mandiraja, Cabang Klampok dan Cabang Punggelan sejak tanggal 22 Februari 2018.</p>', '20180206125631_Eling_S.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('20', null, 'Prapto Oktarianto', '<p>Lahir pada tahun 1969 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir di SMUN I Banjarnegara tahun 1989. Beliau bergabung dengan PT. BPR Surya Yudhakencana Banjarnegara pada bulan Juli 1993 dan bekerja sebagai AO(Account Officer)di Kantor Pusat. Terhitung sejak tanggal 01 Februai 1995, beliau dimutasikan ke Cabang Wanadadi dan Pada tanggal 01 Februai 1996 diangkat sebagai Wakil Kepala Cabang Wanadadi. Namun tidak berselang lama, beliau dimutasikan ke Cabang Karangkobar sejak 01 Agustus 2001. Pada tanggal 02 Oktober 2006 diangkat sebagai Kepala Cabang Karangkobar. Sejak tanggal 26 Desember 2007 Prapto Oktarianto dipercaya manajemen sebagai Kepala Bagian SKAI. Pada akhir bulan Februari 2012 beliau resmi menjabat sebagai Kepala Divisi Audit, Pendidikan dan Litbang kemudian beliau menjabat sebagai Kepala Divisi P3L [Personalia &amp; Pendidikan, Pembukuan, Penelitian &amp; Pengembangan (Litbang)] terhitung sejak Juli 2012, kemudian beliau dipercaya sebagai Kepala Divisi PPS (Personalia, Pendiikan dan Security) kemudian mulai bulan Maret 2014 beliau dipercaya menjadi Kepala Divisi USO (Umum, Security &amp; Operasional). Mulai 23 Februari 2015 beliau dipercaya menjadi Kepala Divisi Operasional, Dana &amp; Security. Beliau menajabat sebagai Kepala Divisi ODD (Operasional dan Dana) sejak tanggal 14 November 2016. Saat ini beliau menjabat sebagai Kepala Divisi Kredit Kendaraan Bermotor dan Asuransi (KKA) sejak tanggal 15 Mei 2017.</p>', '20180206125900_Prapto_O.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('21', null, 'Siti Fauziyah, S.E', '<p>Lahir pada tahun 1978 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1 Jurusan Ekonomi di Universitas Jenderal Soedirman Purwokerto. Siti Fauziyah, S.E. bergabung dengan BPR Bank Surya Yudha pada tahun 1999 dan ditempatkan di Kantor Cabang Mandiraja sebagai Staf Marketing,&nbsp;bulan Maret&nbsp;2001 dimutasi ke Kantor Kas Pasar Besar Banjarnegara dengan jabatan yang sama, bulan Juli&nbsp;2001 dimutasi ke Bagian Operasional Kantor Pusat sebagai staf administrasi kredit,&nbsp;bulan September&nbsp;2001 dimutasi ke Bagian&nbsp;Pembukuan, Sekretariat dan Personalia. Pada bulan Mei 2004 dipercaya sebagai Wakil Kepala Seksi Bagian SKAI. Pada bulan Januari 2005 dipromosikan sebagai Kepala Seksi Bagian SKAI. Pada bulan &nbsp;Juli 2006 dipercaya sebagai Koordinator SPI. Pada bulan Januari 2007 dipromosikan sebagai Wakil Kepala Bagian SKAI. Pada bulan Maret 2011 dipercaya menjadi Kepala Bagian Teknologi Sistem Informasi (TSI). Pada bula Mei 2011 dimutasi ke Bagian Pendidikan &amp; Litbang. Pada bulan Juli 2012 dipercaya sebagai Kepala Bagian ATM Center. Pada September 2012 dipercaya menjadi Kepala Bagian Kepatuhan. Pada bulan Juli 2013 dipercaya sebagai Kepala Bagian Personalia. Pada bulan Februari 2015 dipercaya sebagai Wakil Kepala Divisi IT kemudian dimuatsi ke Divisi Non Operasional pada Desember 2015. Saat ini beliau menjabat sebagai Kepala Divisi Non Operasional sejak 17 Desember 2016.</p>', '20180508104514_fauzi.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('22', null, 'Agus Budi Santoso, S.E.', '<p>Lahir pada tahun 1964 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi Universitas Jendral Soedirman Purwokerto. Agus Budi Santoso, S.E. bergabung dengan BPR Bank Surya Yudha sejak tahun 1992 sebagai staf marketing, kemudian di tahun 1993 sebagai Kepala Seksi Kas Pasar Besar. Pada tahun 1994 beliau dimutasi ke Kas Mandiraja. Pada tahun 1996 beliau dipromosikan ke Bagian PHBKIS. Dan pada tahun 1999 Beliau dipercaya menjabat sebagai Direktur dan pada tahun 2009 beliau dipromosikan menjadi Direktur Utama hingga Juli 2015. Mulai bulan Agustus 2015 beliau ditugaskan menjadi Kepala WIlayah I. Saat ini beliau dipercaya sebagai Kepala Divisi Operasional, Dana danTreasury(ODT) sejak 15 Mei 2017.</p>', '20180206130026_Santoso.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('23', null, 'Anindita Alisia Amanda., S. Kom', '<p>Lahir pada tahun&nbsp;1992 di Makasar&nbsp;dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1&nbsp;Jurusan Teknik Informatika di Institut Teknologi Sepuluh Nopember Surabaya. Beliau bergabung dengan BPR Bank Surya Yudha Banjarnegara pada November 2014 dan menjabat sebagai Kepala Bagian<em>&nbsp;Electronic Banking and Product Development</em>. Pada 2016, beliau dipercaya menjabat sebagai Kepala Bagian <em>Marketing Communication</em>.&nbsp;Pada tanggal 09 Agustus&nbsp;2017,&nbsp;beliau menjabat sebagai Wakil Kepala Divisi <em>Marketing Communication</em>, Satuan Kerja Kepatuhan &amp; Manajemen Resiko, dan Pendidikan.&nbsp;Saat ini beliau menjabat sebagai Wakil Kepala Divisi <em>Marketing Communication</em><em>&nbsp;and Learning Center</em>&nbsp;&amp; Satuan Kerja Kepatuhan &amp; Manajemen Risiko&nbsp;sejak tanggal 30 Januari 2018.</p>', '20180206130036_Aninditajpg.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('24', null, 'Ashar Fathudin, S.E', '<p>Lahir pada tahun 1972 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di Universitas Jendra Soedirman Purwokerto. Ahar Fathudi, S.E. bergabung dengan BPR Bank Surya Yudha pada Mei 1995 sebagai staf marketing Cabang Wanadadi. Pada tahun 2000, beliau dipercaya sebagai Wakil Kepala Cabang Utama sampai dengan tahun 2006, kemudian dimutasi ke Kantor Cabang Klampok sebagai Wakil Kepala Cabang sampai dengan tahun 2009. Pada Oktober 2009 dipromosikan sebagai Kepala Cabang Dieng. Pada 03 Maret 2017, beliau dipromosikan sebagai Kepala Cabang Utama sampai saat ini.</p>', '20180206130054_Ashar.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('25', null, 'Drs. Yudhi Saptana', '<p>Lahir pada tahun 1963 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 di Universitas Widya Mataram Yogyakarta. Drs. Yudhi Saptana mengawali karirnya di BPR Bank Surya Yudha sebagai tenaga marketing di wilayah Wanadadi. Pada tahun 1998 beliau menjabat sebagai Kepala Seksi Dana dan Kredit Kantor Pusat, dan dua tahun kemudian di tahun 2000 jabatannya meningkat menjadi Kepala Cabang Utama. Drs. Yudhi Saptana pada tahun 2002-2003 dimutasi ke BPR Surya Yudha Wonosobo sebagai Kepala Bagian Kredit, kemudian di bulan Oktober 2003 dimutasi kembali ke PT. BPR Surya Yudhakencana Banjarnegara untuk menjabat sebagai Kepala Cabang Utama. Pada 1 Juli 2016, beliau dimutasi ke Bagian PHBKIS sebagai Kepala Bagian. Menjabat sebagai Kepala Cabang Pasar Besar sejak tanggal 01 Maret 2017. Saat ini beliau menjabat sebagai Kepala Bagian Kredit Kendaraan Bermotor dan Asuransi (KDA) sejak 05 Maret 2018.</p>', '20180206130158_Y_Saptana.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('26', null, 'Ariyanto, S.E.', '<p>Lahir pada tahun 1980 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di Universitas Widyawiwaha Yogyakarta. Ariyanto, S.E. mulai bergabung dengan BPR Bank Surya Yudha pada Maret 2005 staf Bagian PHBKIS. Setelah itu dimutasi ke Cabang Singamerta. Karir beliau mulai meningkat pada tahun 2010 dengan menjabat sebagai Kepala Kas Madukara dan pada tahun 2011 beliau diangkat sebagai Wakil Kepala Cabang Singamerta. Pada bulan November 2014 beliau diangkat menjadi Kepala Cabang Mandiraja. Pada tanggal 13 Juli 2016, beliau dimutasi ke kantor Cabang Singamerta sebagai Kepala Cabang.</p>', '20180206130210_ARI.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('27', null, 'Thoufik Hidayat, S.H', '<p>Lahir pada tahun 1977 di Banjarnegaram memiliki latar belakang pendidikan S1 Hukum di Universitas Wijaya Kusuma Purwokerto lulus pada tahun 2016. Thoufik Hidayat, S.H. bergabung dengan BPR Bank Surya Yudha pada tahun 2001 di Kantor Cabang Mandiraja. Pada tahun 2003, dimutasi ke Kantor Cabang Purwonegoro. Pada tahun 2007 dipromosikan sebagai Wakil Kepala Seksi di Kantor Cabang Purbalingga. Dipromosikan menjadi Kepala Kas Tunggara pada tahun 2008. Dipromosikan menjadi Wakil Kepala Cabang Singamerta pada tahun 2010. Pada tahun 2011 dimutasi ke Kantor Cabang Batur sebagai Wakil Kepala Cabang. Pada tahun 2012 dimutasi sebagai Wakil Kepala Cabang di Kantor Cabang Klampok. Pada tahun 2015 dimuatsi ke Kantor Cabang Pasar Besar sebagai Wakil Kepala Cabang. Pada tahun 2016 dimutasi ke Kantor Cabang Mandiraja dan pada 19 Mei 2016 dimutasi ke Kantor Cabang Purwonegoro sebagai Wakil Kepala Cabang. Beliau dipromosikan sebagai Kepala Cabang Pasar Besar sejak 13 Juli 2016. Saat ini beliau dipercaya sebagai Kepala Cabang Purwonegoro sejak 01 Maret 2017.</p>', '20180206130236_Toufik.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('28', null, 'Saryono, S.E', '<p>Lahir pada tahun 1976 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi Universitas Jendral Soedirman. Saryono, S.E. mulai bergabung dengan BPR Bank Surya Yudha Banjarnegara pada tahun 1997 dan dipercaya sebagai Staff Marketing Cabang Wanadadi. Terhitung sejak tanggal 21 Maret 2001, beliau diangkat sebagai Kasi Dana di Cabang Wanadadi. Setelah hampir 3 tahun menjabat sebagai Kasi Dana di Cabang Wanadadi, beliau dipromosikan sebagai Kasi Kredit di Cabang Wanadadi. Kemudian beliau diangkat sebagai Kasi Senior di Cabang Wanadadi dan menjabat kurang lebih 3 tahun. Setelah hampir 10 tahun, beliau diangkat sebagai Wakil Kepala Cabang di BPR Bank Surya Yudha Cabang Wanadadi. Pada tanggal 16 Maret 2009, beliau dipercaya sebagai Kepala Kantor Kas Pasar Besar Banjarnegara. Dan pada tanggal 07 September 2009 sampai 08 Februari 2010, beliau dipercaya sebagai Kepala Cabang Singamerta. Tanggal 08 Februari 2010 dimutasi ke Cabang Batur sebagai Kepala Cabang. Sejak 27 September 2010 Saryono, S.E. telah dipercaya kembali oleh manajemen sebagai Kepala Cabang Pasar Besar Banjarnegara. Pada tanggal 01 April 2015 beliau dimutasi ke Bagian PHBKIS sebagai Kepala Bagian. Pada tanggal 23 Oktober 2015, beliau dipercaya kembali sebagai Kepala Cabang Pasar Besar. Pada tanggal 13 Juli 2016, beliau dipercaya menjadi Kepala Cabang Klampok. Saat ini beliau menjabat sebagai Kepala Wilayah IV yang membawahi Cabang Pagentan, Cabang Batur dan Cabang Dieng sejak 15 Februari 2018.</p>', '20180206130328_Saryono.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('29', null, 'M. Makhmuri., S.E', '<p>Lahir pada tahun 1985 di Banjarnegara, memiliki latar belakang pendidikan S1 Fakultas Ekonomi di STIE Cendekia Karya Utama. M. Makhmuri, S.E. memulai karir di BPR Bank Surya Yudha sebagai AO (Account Officer). Pada tahun 2011 dipromosikan sebagai Wakil Kepala Kas Sokaraja Cabang Purwokerto. Beliau dimutasi ke Kantor Kas Pasar Wage Cabang Purwokerto sebagai Wakil Kepala Kas pada tahun 2012. Pada tahun 2014 M. Makhmuri, S.E. dipercaya sebagai Kepala Kas Banyumas pada Mei 2012. Pada 2015 beliau dipromiskan menjadi Wakil Kepala Cabang Banyumas. Pada tahun 2016 beliau dimutasi ke Kantor Cabang Purbalingga sebagai Wakil Kepala Cabang. Dan saat ini beliau menjabat sebagai Kepala Cabang Mandiraja sejak 02 November 2016.</p>', '20180206130404_Uri.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('30', null, 'Bondan Wahyu Nirboyo, S.E.', '<p>Lahir pada tahun 1976 di Banjarnegara, memiliki latar belakang pendidikan terakhir di STIE Widya Wiwaha Yogyakarta. Bondan Wahyu Nirboyo, S.E. bergabung dengan BPR Bank Surya Yudha sejak Mei 2006 sebagai Staf marketing Cabang Utama kemudian pada Juli 2010 beliau dipromosikan sebagai Kepala Kas Bawang dan pada tahun 2011 beliau dipromosikan menjadi Wakil Kepala Cabang Purwonegoro. Pada tanggal 7 Oktober 2013 beliau diberi kepercayaan untuk menjadi Kepala Cabang Mandiraja. Mulai bulan April 2014 beliau dimutasikan ke Cabang Bobotsari sebagai Kepala Cabang. Pada tahun 2015, beliau dipercaya sebagai Kepala Cabang Wanadadi sejak tanggal 26 Oktober 2015.</p>', '20180206130427_Bondan_W.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('31', null, 'Sigit Dwi Sarwoko', '<p>Lahir pada tahun 1991 di Banjarnegara, memiliki latar belakang pendidikan terakhir SMK Cokroaminoto 2 Banjarnegara lulus pada tahun 2009. Sigit Dwi Sarwoko bergabung dengan BPR Bank Surya Yudha sejak November 2009 sebagai Staf Bagian Operasional danElectronic Data ProcessingKantor Pusat. Pada bulan Maret 2010 dimutasi sebagai Marketing di Kantor Cabang Utama. Pada bulan Februari 2012 dimutasi ke Kantor Cabang Wanadadi sebagaiAccount OfficerKantor Cabang Wanadadi. Pada bulan Maret 2014, beliau dipromosikan sebagai Wakil Kepala Seksi Kantor Cabang Wanadadi. Pada bulan Maret 2015, beliau dipercaya sebagai Wakil Kepala Kas Rakit Cabang Wanadadi. Pada bulan April 2015 dipromosikan sebagai Kepala Kas Punggelan Cabang Wanadadi. Pada bulan Juli 2016 dipromosikan sebagai Wakil Kepala Cabang Wanadadi. Pada bulan Maret 2017 dipercaya sebagai Ketua Kelompok Kerja Punggelan. Saat ini beliau menjabat sebagai Kepala Cabang Punggelan sejak 09 Juni 2017.</p>', '20180206194421_sarwoko.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('32', null, 'Zaenal Abidin, S.E', '<p>Lahir pada tahun 1980 di Banjarnegara&nbsp;dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan terakhir S1 Fakultas di STIE Widya Wiwaha Yogyakarta. Zaenal Abidin, S.E. masuk sebagai Staff Marketing di Cabang Karangkobar&nbsp;tahun 2001&nbsp;dan pada tahun 2004&nbsp;sebagai Staf Bagian EDP. Pada tahun 2008 dipercaya sebagai Wakil Kepala Seksi Cabang Karangkobar. Pada tahun 2009 dipromosikan sebagai Kepala Kas Pagentan. Pada tahun 2010 dipromosikan menjadi Wakil Kepala Cabang Kalibening. &nbsp;Pada tahun 2013 beliau dimutasi ke Kantor Cabang Wanadadi sebagai Wakil Kepala Cabang. Pada tahun 2015 beliau dipercaya menjabat sebagai Kepala Cabang Purwonegoro. Saat ini beliau dipercaya sebagai Kepala Cabang Karangkobar sejak tanggal 06 Maret 2017.</p>', '20180206130543_Zaenal_A.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('33', null, 'Noor Alam Rudwiansyah, S.E', '<p>Lahir di Banjarnegara 05 Desember 1982. Memiliki latar belakang pendidikan S1 Ekonomi di Universitas Jendral Soedirman lulus pada tahun 2006. Bergabung dengan BPR Bank Surya Yudha pada 03 April 2006 sebagai staf Marketing di Kantor Kas Pasar Besar. Pada Juli 2010 dipercaya menjadi Wakil Kepala Kas di Kantor Kas Rembang. Pada November 2010 dipromosikan menjadi Kepala Kas Karangmoncol. Bulan Maret 2013 dimutasi ke Kantor Kas Rembang sebagai Kepala Kas. Pada Bulan Maret 2014, dipromosikan menjadi Wakil Kepala Cabang Karangkobar. Pada bulan Mei 2016 dimutasi ke Kantor Cabang Wanadadi sebagai Wakil Kepala Cabang. Saat ini beliau dipercaya menjadi Kepala Cabang Kalibening sejak 13 Juli 2016.</p>', '20180206130625_Dwi.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('34', null, 'Agung Sindhi Nugroho, S.E', '<p>Lahir pada tahun 1980 di Banjarnegara, memiliki latar belakang pendidikan terakhir di Universitas Jenderal Soedirman Purwokerto. Agung Sindhi Nugroho, S.E. pada tanggal 10 Desember 2003 bergabung dengan PT. BPR Surya Yudhakencana Banjarnegara sebagai Staf Bagian Umum Kantor Pusat. Dan karirnya mulai meningkat pada tahun 2006 dengan diangkat menjadi Wakil Kepala Seksi Cabang Karangkobar. Dan pada tahun 2008 beliau dipromosikan menjadi Koordinator Kas Pagentan Cabang Karangkobar. Kemudian pada tahun 2009 &ndash; 2010 beliau menjabat menjadi Wakil Kepala Cabang Karangkobar. Dan pada tahun 2011 beliau dimutasikan ke Cabang Dieng dan menjabat sebagai Kepala Cabang. Dan beliau dimutasikan lagi pada akhir tahun 2011 menjadi Kepala Cabang Karangkobar. Mulai bulan April 2014 beliau dimutasikan ke Cabang Pagentan sebagai Kepala Cabang.</p>', '20180206130644_Agung_S.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('35', null, 'Agus Budiyanto, A.Md.', '<p>Lahir pada tahun 1975 di Banjarnegara, memliki latar belakang pendidikan terakhirD3 Sekolah Tinggi Pembangunan Masyarakat Desa Yogyakarta.Agus Budiyanto, A.Md. bergabung dengan BPR Bank Surya Yudha sejak Maret 2008 sebagai Staf marketing di Cabang Karangkobar. Pada bulan April 2009 Beliau dipromosikan menjadi Kepala Kas Pejawaran. Pada Januari 2011 Beliau diangkat menjadi Wakil Kepala Cabang Batur hingga Desember 2011, kemudian Beliau dimutasi ke Cabang Pekalongan dan pada bulan Februari 2012 beliau dimutasi ke Cabang Karangkobar. Pada bulan Juni 2015 beliau dipromosikan menjadi Kepala Cabang Kalibening. Mulai bulan September 2015 beliau dimutasi ke Cabang Batur sebagai Kepala Cabang.</p>', '20180206130706_Agus_B.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('36', null, 'Teguh Miswanto', '<p>Lahir pada tahun 1988 di Banjarnegara. Memiliki pendidikan terakhir SMK Pancha Bhakti lulus pada tahun 2007. Memulai karir di BPR Bank Surya Yudha bulan September 2011 di Kantor Kas Pagedongan Cabang Pasar Besar. Pada bulan April 2015, beliau dipromosikan sebagai Kepala Kas Pagedongan Cabang Pasar Besar. Pada bulan November 2016, beliau dipromosikan sebagai Wakil Kepala Cabang Singamerta. Menjabat sebagai Kepala Cabang Dieng sejak 03 Mei 2017. Saat ini beliau menjabat sebagai Kepala Cabang Cilacap sejak 05 Maret 2018.</p>', '20180508104445_iswan.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('37', null, 'Darminto', '<p>Lahir pada tahun 1983 di Pekalongan, memiliki latar belakang pendidikan terakhir di SMU PGRI 2 Kajen. Darminto bergabung dengan BPR Bank Surya Yudha sebagai marketing di Kantor Kas Kalibening pada tahun 2004. Pada tahun 2006 beliau menjadi AO Kas Kalibening. Pada tahun 2009, beliau dipromosikan menjadi Wakil Kepala Seksi Yunior Kantor Cabang Kalibening dan pada tahun 2011 beliau dimutasi ke Kantor Cabang Pekalongan sebagai Wakil Kepala Seksi. Pada tahun 2013 beliau dipercaya menjadi Wakil Kepala Cabang Pekalongan. Pada 01 September 2015 beliau dipromosikan menjadi Kepala Cabang Kalibening. Pada tanggal 13 Juli 2016, beliau dipercaya menjadi Kepala Cabang Pekalongan.</p>', '20180206130726_Darminto.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('38', null, 'Handi Ria Purnama Putra, S.E', '<p>Lahir pada tahun 1983 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di STIE STIKUBANK Semarang. Handi Ria Purnama Putra, S.E. bergabung dengan BPR Bank Surya Yudha dimulai pada bulan Oktober 2007 sebagai staff di Kantor Cabang Purbalingga. Bulan Maret 2008 beliau menjadi marketing di Kantor Cabang Purbalingga. Pada bulan Maret 2010 beliau menjadi AO di Kantor Kas Kemangkon Cabang Purbalingga. Bulan Juli 2010 beliau diangkat menjadi Wakil Kepala Kantor Kas Kemangkon. Pada bulan September 2014 beliau menjadi Wakil Kepala Cabang Purbalingga. Dan pada Oktober 2015 beliau dipromosikan menjadi Kepala Cabang Bobotsari.</p>', '20180206130804_handi.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('39', null, 'Dian Agung Sasongko, S.E', '<p>Lahir pada tahun 1983 di Purbalingga, memiliki latar belakang pendidikan terakhir S1 Ekonomi di Universitas Muhammadiyah Yogyakarta. Dian Agung Sasongko, S.E. memulai karir di BPR Bank Surya Yudha pada tahun 2009 sebagai marketing di Kantor Cabang Bobotsari. Pada tahun 2012 dipromosikan sebagai Wakil Kepala Seksi di Cabang Bobotsari. Pada tahun 2013 dimutasi ke Kantor Kas Karangreja sebagai Wakil Kepala Kas. Pada tahun 2014 dipercaya sebagai Kepala Kas Karangreja. Pada 2015 dipromiskan menjadi Wakil Kepala Cabang Bobotsari. Menjabat sebagai Kepala Cabang Mandiraja sejak 09 Agustus 2016. Saat ini beliau menjabat sebagai Kepala Cabang Karangreja sejak tanggal 20 Februari 2017.</p>', '20180206194338_sasongko.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('40', null, 'Supriyadi, A.Md', '<p>Lahir pada tahun 1974 di Purbalingga, memiliki latar belakang pendidikan terakhir D3 Universitas Negeri Jendral Soedirman Purwokerto. Supriyadi, A.Md bergabung dengan BPR Bank Surya Yudha sejak Juli 2001, pada bulan September 2005 beliau dipromosikan menjadi Kepala Kas di Bobotsari, pada April 2009 beliau diangkat menjadi Wakil Kepala Cabang Bobotsari dan pada 16 Juni 2014 beliau dipromosikan menjadi Kepala Cabang Rembang.</p>', '20180206130904_Supriyadi.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('41', null, 'Joko Prasetyo, S.E', '<p>Lahir pada tahun 1982 di Banjarnegara, memiliki latar belakang pendidikan S1 Ekonomi Universitas Wijaya Kusuma Purwokerto. Joko Prasetyo bergabung dengan BPR Bank Surya Yudha pada 02 November 2009 sebagai AO Kantor Cabang Pasar Besar. Pada tahun 2013, beliau dipromosikan menjadi Kepala Kas Pagedongan. Pada tahun 2014, beliau dipercaya menjadi Wakil Kepala Cabang Madiraja. Pada tahun 2015 hingga sekarang beliau dipercaya sebagai Kepala Cabang Dieng. Pada bulan Mei 2017 dimutasi ke Kantor Cabang Purbalingga sebagai Kepala Cabang.</p>', '20180206130932_Joko.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('42', null, 'Muhamad Nur', '<p>Lahir pada tahun 1977 di Jakarta, memiliki latar belakang pendidikan SMA Bina Kusuma Pesanggrahan Jakarta Selatan. Muhamad Nur bergabung dengan BPR Bank Surya Yudha pada 01 Juni 2002 sebagai staf Kantor Cabang Klampok. Pada Desember 2007 beliau dipromosikan menjadi Kepala Kas Karanglewas Cabang Purwokerto. Pada Januari 2011 dipercaya sebagai Wakil Kepala Cabang Klampok. Pada November 2014 beliau dimutasi ke Kantor Cabang Purbalingga sebagai Wakil Kepala Cabang. Pada Oktober 2015 dimutasi ke Kantor Cabang Purwokerto. Pada Juli 2016 beliau dimutasi ke Kantor Cabang Banyumas sebagai Wakil Kepala Cabang. Mulai 08 September 2017 beliau dipercaya sebagai Kepala Cabang Banyumas.</p>', '20180508104426_mnur.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('43', null, 'Wahyu Adi Wibowo, S.H', '<p>Lahir pada tahun 1983 di Purbalingga, memiliki latar belakang pendidikan S1 Hukum di Universitas Jendral Soedirman Purwokerto. Wahyu Adi Wibowo, S.H. bergabung dengan BPR Bank Surya Yudha pada tahun 2008 di Kantor PHBKIS sebagai marketing. Pada tahun 2012 dipromosikan menjadi Wakil Kepala Seksi PHBKIS. Pada tahun 2013 dipromosikan menjadi Kepala Kas Dukuhwaluh. Pada tahun 2015 dipromosikan menjadi Wakil Kepala Cabang Purwokerto. Pada tahun 2016 dimutasi ke Kantor Kelompok Kerja Kroya sebagai Kepala Kelompok Kerja. Pada tanggal 13 Juli 2016, dipromosikan menjadi Kepala Cabang Purwokerto. Pertanggal 19 Februari 2018 beliau dipromosikan menjadi Kepala Wilayah IX yang membawahi Cabang Cilacap dan Cabang Kroya.</p>', '20180206130950_Awi.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('44', null, 'Tri Budiyanto, S.P', '<p>Lahir pada tahun 1982 di Cilacap, memiliki latar belakang terakhir S1 Fakultas Peternakan di Universitas Jendral Soedirman Purwokerto. Tri Budiyanto, S.Pt. Bergabung dengan BPR Bank Surya Yudha sebagai marketing Cabang Purwokerto pada Mei 2006. Pada Maret 2010 dipromosikan menjadi Kepala Kas Pabuaran Cabang Purwokerto. Pada April 2013 dipercaya menjadi Wakil Kepala Cabang Purwokerto. Pada Oktober 2015 dipromosikan menjadi Ketua Kelompok Kerja Ajibarang. Pada Mei 2016 beliau menjabat sebagai Kepala Cabang Ajibarang.</p>', '20180206131007_Trian.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('45', null, 'Zaenal Arifin', '<p>Lahir pada tahun 1985 di Banjarnegara, latar belakang pendidikan terakhir SMK Cokroaminoto 2 Banjarnegara. Zaenal Arifin bergabung dengan BPR Bank Surya Yudha sejak Juni 2004 sebagai Account Officer Cabang Wanadadi kemudian pada April 2007 beliau dipromosikan sebagai Wakil Kepala Kas Punggelan dan pada Januari 2010 beliau dipromosikan menjadi Kepala Kas Punggelan. Pada tahun 2011 beliau diberi kepercayaan untuk menjadi Wakil Kepala Cabang Wanadadi dan pada Maret 2013 beliau menjabat sebagai Kepala Cabang Wanadadi. Tahun 2015 beliau dipercaya sebagai Kepala Cabang Cilacap per tanggal 02 November 2015. Mulai tanggal 05 Maret 2018 dipercaya sebagai Kepala Cabang Cilacap.</p>', '20180206131029_Zaenal_Ar.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('46', null, 'Zaenal Faidzin, A.Md.', '<p>Lahir di Purbalingga, 05 Agustus 1982. Memiliki latar belakang pendidikan D3 Jurusan Manajemen Informatika di AMIK Veteran Purwokerto lulus pada tahun 2004. Bergabung dengan BPR Bank Surya Yudha sejak bulan Mei 2013 di Bagian PHBKIS. Pada bulan Februari 2015 sebagai Kepala Kas Rawalo Cabang Banyumas. Pada bulan November 2015 dipromosikan sebagai Wakil Kepala Cabang Cilacap. Beliau dipercaya sebagai Kepala Cabang Kroya sejak 14 November 2016. Saat ini beliau dipercaya sebagai Kepala Cabang Purbalingga sejak 13 April 2018.</p>', '20180206183100_IMG-20180206-WA0001.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('47', null, 'Andi Pratiswo', '<p>Lahir pada tahun 1978 di Banjarnegara, memiliki latar belakang Pendidikan terakhir SMK Cokroaminoto Banjarnegara lulus pada tahun 1999. Bergabung dengan BPR Bank Surya Yudha mulai 13 Maret 200 sebagai marketing di Pasar Besar selama 2 tahun (2000 s/d 2002). Kemudian dimutasikan ke Bagian PHBKIS pada tahun 2002 kemudian dimutasikan ke Bagian Internal Audit dan pada tahun 2008 dipromosikan sebagai Wakil Kepala Bagian SKAI. Pada tanggal 13 Februari 2013 beliau diberi kepercayaan menjadi Kepala Bagian SKAI. Saat ini beliau dipercaya sebagai Kepala Divisi SKAI sejak 13 April 2018.</p>', '20180206131120_wowok.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('48', null, 'Wirasto, S.E', '<p>Lahir pada tahun 1978 di Sragen, memiliki latar belakang pendidikan terkahir S1 Fakultas Ekonomi di STIE LPI Makasar. Wirasto, S.E. bergabung dengan BPR Bank Surya Yudha sejak Mei 2007 sebagai staf Kredit Motor. Pada tahun 2011 beliau dipromosikan menjadi Wakil Kepala Seksi Bagian PHBKIS. Pada tahun 2013 dipromosikan sebagai Wakil Kepala Bagian PHBKIS. Pada tahun 2014, beliau dimutasi ke Bagian PHBKIS. Beliau manjabat sebagai Kepala Bagian SKAI Tim A sejak 14 April 2016. Saat ini beliau menjabat sebagai Wakil Kepala Divisi SKAI per tanggal 1 Maret 2019.</p>', '20180206194546_wirasto.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('49', null, 'Rendra Eka Wijaya, A.Md.', '<p>Lahir pada tahun 1973 di Jakarta, memiliki latar belakang pendidikan terkahir D3 di Akademi Keuangan dan Perbankan LPI Jakarta. Rendra Eka Wijaya, A.Md. bergabung dengan BPR. Bank Surya Yudha pada tahun 1997 dengan menjabat sebagai marketing. Sempat dimutasi dan dipromosikan di berbagai bagian, Rendra Eka Wijaya sempat menjabat sebagai Kepala Seksi Umum Cabang Pasar Besar, kepala seksi Internal Audit , Kepala Seksi Bagian Umum, Kepala Seksi Bagian PKB dan SKAI. Kemudian beliau dipromosikan menjadi Kepala Bagian Umum dan pada tanggal 21 Oktober 2013 beliau dimutasikan ke Bagian Pendidikan sebagai Kepala Bagian. Pada&nbsp;September 2014 beliau dimutasi ke Bagian SKAI Tim B sebagai Kepala Bagian. Saat ini beliau menjabat sebagai Wakil Kepala Bagian Penyelesaian Kredit Bermasalah (PKB) sejak 26 Juni 2018.</p>', '20180206131225_Rendra_E_K_.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('50', null, 'Susi Faiqoh, A.Md', '<p>Lahir pada tahun 1978 di Banjarnegara, memiliki latar belakang pendidikan terakhir D3Administrasi Niaga di Politeknik Negeri Semarang.Susi Faiqoh, A.Md. bergabung dengan BPR Bank Surya Yudha pada tahun 2000 sebagai marketing di Kantor Cabang Wanadadi. Pada tanggal 11 Februari 2002, dimutasi ke Bagian Operasional sebagai Kasir. Pada tanggal 24 Januari 2007,beliau dimutasi menjadi Wakil Kepala Seksi Bagian SPI (Satuan Pengawas Intern). Pada tanggal 27 April 2010, beliau dimutasi menjadi Wakil Kepala Seksi Yunior di Kantor Cabang Pasar Besar. Pada tanggal 16 Mei 2011, beliau dimutasi dari Cabang Pasar Besar ke Bagian Pembukuan Kantor Pusat. Beliau dimutasi dari Bagian Pembukuan ke Bagian Personalia per tanggal 22 September 2011 sebagai Wakil Kepala Seksi Yunior. Pada 23 Maret 2013, beliau dipromosikan menjadi Wakil Kepala Seksi Senior Bagian Personalia, dan menjadi Kepala Seksi Yunior Personalia pada tanggal 16 Oktober 2013. Beliau dipromosikan sebagai Wakil Kepala Bagian Personalia pada tanggal 17 Maret 2014. Beliau menjadi Kepala Bagian Personalia sejak 22 Juni 2015. Saat ini beliau menjabat sebagai Wakil Kepala Divisi Human Resources Development sejak 13 April 2018</p>', '20180206131238_Susi.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('51', null, 'Eni Mulyati, S.E', '<p>Lahir pada tahun 1973 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di STIE Widya Wiwaha Yogyakarta. Eni Mulyati, S.E. bergabung dengan BPR Bank Surya Yudha pada bulan Desember tahun 1996 sebagai petugas marketing di Cabang Wanadadi. Pada tahun 2009 beliau diangkat menjadi Wakil Kepala Seksi Cabang Wanadadi. Pada Tahun 2011 beliau dimutasi ke Bagian SKAI. dan Pada tahun 2014 beliau dirpomosikan menjadi Kepala Bagian Pembukuan Kantor Pusat. Mulai bulan Februari 2015 beliau dipercaya menjadi Kepala Bagian Pendidikan. Kemudian mulai bulan Juli 2015 beliau dimutasi kembali ke Bagian Pembukuan sebagai Kepala Bagian.</p>', '20180206131629_eni_M.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('52', null, 'Aunur Rofiq', '<p>Lahir pada tahun 1975 di Surabaya, memiliki latar belakang pendidikan terakhir SMA PGRI 7 Surabaya. Aunur Rofiq bergabung dengan BPR Bank Surya Yudha sejak November 2004 sebagai Staf Bagian Umum kemudian tahun 2009 beliau dipromosikan sebagai Wakil Kepala Seksi dan pada tahun 2012 beliau dipromosikan menjadi Kepala Seksi. Pada bulan Maret 2013 beliau diberi kepercayaan untuk menjadi Wakil Kepala Bagian Umum dan mulai bulan Oktober 2013 beliau dipercaya sebagai Kepala Bagian Umum.</p>', '20180206131713_Onny.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('53', null, 'Roni Good Andiyasa', '<p>Lahir pada tahun 1976 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di Universitas Widya Wiwaha Yogyakarta. Rony Good Andiyasa, S.E. Bergabung dengan BPR Bank Surya Yudha pada tahun 1995 dan menjadi staf marketing di Kas Keliling Karangkobar. Beliau juga pernah menjabat sebagai staf EDP pada tahun 1998 &ndash; 2001 dan pada tahun 2001 beliau dipromosikan menjadi Kepala Seksi Bagian EDP hingga tahun 2007. Karirnya semakin menanjak pada tahun 2009 dengan diangkat menjadi Kepala Cabang Singomerto. Belum genap satu tahun beliau dimutasikan ke Kas Pasar Besar yang akhirnya pada tahun 2010 menjadi Cabang Pasar Besar Banjarnegara dan beliau menduduki sebagai Kepala Cabang. Pada bulan September 2010 beliau dimutasikan kembali ke Cabang Karangkobar dan menjabat sebagai Wakil Kepala Cabang dan ditahun 2011 beliau diangkat menjadi Kepala Cabang Pokja Cabang Pagentan. Pada bulan Oktober 2011 beliau dimutasikan ke Cabang Kalibening sebagai Kepala Cabang dan mulai 15 Juni 2015 beliau dimutasi ke Bagian EDP Kantor Pusat sebagai Kepala Bagian.</p>', '20180206131809_Roni.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('54', null, 'Sri Murwati, S.E', '<p>Lahir pada tahun 1980 di Banjarnegara, memiliki latar belakang pendidikan terakhir S1 Fakultas Ekonomi di STIE Widya Wiwaha Yogyakarta. Sri Murwati, S.E. bergabung dengan BPR Bank Surya Yudha pada bulan Juli tahun 2001 sebagai petugas marketing di Kas Pasar Besar. Pada tahun 2002 sampai dengan tahun 2003 menjabat sebagai marketing di Cabang Utama, pada tahun 2003 dimutasi ke Kas Singamerta sebagai petugas Pembukuan. Pada tahun 2005 dimutasi ke Bagian Operasional Kantor Pusat. Pada tahun 2011 beliau dipromosikan menjadi Wakil kepala Seksi Bagian Operasional dan pada tahun 2013 diangkat menjadi Kepala Seksi Bagian Operasional. Pada bulan Maret 2014 beliau diangkat menjadi kepala Bagian Operasional.</p>', '20180206131830_Sri.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('55', null, 'Jacoeb Rs', '<p>Lahir pada tahun 1949 di Banjarnegara, Jacoeb RS. bergabung dengan PT. BPR Surya Yudhakencana Banjarnegara pada 02 Mei 2011 sebagai Kepala seksi Security Kantor Pusat. Pada tanggal 02 Agustus 2011, beliau dipromosikan menjadi Kepala Bagian Satpam Kantor Pusat hingga sekarang.</p>', '20180508104405_nugroho.png', null, '0', '0');
INSERT INTO `direksi` VALUES ('56', null, 'Teguh Santosa, A.Md.', '<p>Lahir pada tahun 1984 di Banjarnegara, memiliki latar belakang pendidikan terakhir D3 Ekonomi Akuntasi di Universitas Teknologi Yogyakarta. Teguh Santosa, A.Md. Mulai bergabung dengan BPR Bank Surya Yudha pada November 2010 sebagai staf marketing di Bagian PHBKIS. Pada bulan Juli 2011dipercaya menjadiAccount OfficerBagian PHBKIS. Pada tahun 2014 beliau dipromosikan menjadi Kepala Seksi Kredit Bagian PHBKIS. Pada September 2016 beliau kembali dipromosikan sebagai Wakil Kepala Bagian PHBKIS. Saat ini beliau menjabat Kepala Bagian PHBKIS sejak tanggal 01 Maret 207.</p>', '20180206131920_Tosa.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('57', null, 'Agus Sudiyanto', '<p>Lahir pada tahun 1963 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang bekerja di VINLUX IN&rsquo;L CORP, Jakarta sebagai Computer Operator pada tahun 1988-1989, merangkap bekerja pada salah satu BPR di Sidoarjo Surabaya hingga tahun 1991. Beliau mulai bergabung dengan PT. BPR Surya Yudhakencana Banjarnegara pada tahun 1991-2003 dan menduduki jabatan sebagai Kepala Divisi Kredit, pada tahun 2003-2010 Agus Sudiyanto menjabat sebagai Kepala Bagian Internal Audit di PT. BPR Surya Yudha Kertek &ndash; Wonosobo. Saat ini Agus Sudiyanto menjabat sebagai Pemegang Saham PT. BPR Surya Yudha Kertek &ndash; Wonosobo dan Direktur PT. Sarana Dewa Putra.</p>', '20180304194727_pak_agus_edit.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('58', null, 'Saptono Setyartoyo', '<p>Lahir pada tahun 1968 di Brebes dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan Fakultas Peternakan Universitas Diponegoro Semarang pada tahun 1993. Memulai karir pada tahun 1997-2010 bekerja di PT. BPR Surya Yudhakencana Banjarnegara dengan jabatan terakhir sebagai Kepala Wilayah. Setelah itu beliau bergabung dengan PT. BPR Surya Yudha pada Maret 2010 dan ditugaskan sebagai Kadiv Kredit sampai dengan 25 Mei 2010. Pada Juni 2010 beliau menjabat sebagai Direktur Utama PT. BPR Surya Yudha.</p>', '20180122113459_SAPTONO.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('59', null, 'Amin Sutrisno, SE', '<p>Lahir pada tahun 1971 di Wonosobo dengan kewarganegaraan Indonesia. Memiliki latarbelakang pendidikan STIE Kerjasama Yogyakarta pada tahun 1995. Pada tahun 1998- 2008 beliau bergabung dengan PT. BPR Surya Yudha dengan menjabat sebagai Wakil Kepala Cabang Temanggung, tahun 2008-2009 beliau bergabung dengan PT. BPR Surya Yudhakencana Banjarnegara dengan jabatan terakhir sebagai Kepala Cabang Singamerta, kemudian bergabung kembali dengan PT. BPR Surya Yudha menjabat sebagai Kepala Cabang Temanggung dan sejak tahun 2011 hingga bulan Agustus 2012 jabatan beliau sebagai Kepala Divisi Kredit. Saat ini beliau menjabat sebagai Direktur PT. BPR Surya Yudha sejak 23 Agustus 2012.</p>', '20180122113512_AMIN-SUTRISNO.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('60', null, 'Sucipto, SE', '<p>Sucipto bergabung dengan PT. BPR Surya Yudhakencana sejak tahun 1996 sebagai Staf Marketing dan tahun 1997 sebagai Account Officer. Pada tahun 1998 beliau dimutasikan ke PT. BPR Surya Yudha sebagai Account Officer. Tahun 2001 sampai dengan tahun 2003 beliau menjabat sebagai Kepala Seksi Kantor pelayanan Kas Pasar Wonosobo. Pada pertengahan tahun 2003 beliau dipromosikan sebagai Wakil Kepala bagian Kredit dan di tahun 2005 diangkat sebagai Kepala Bagian Kredit. Dengan adanya pembukaan Kantor Cabang Wonosobo yang beroperasional sejak tanggal 02 Agustus 2010, beliau dipercaya untuk menduduki jabatan sebagai kepala Cabang Wonosobo. Pada bulan Mei 2010 beliau diangkat sebagai Kepala Cabang Temanggung. Bulan Februari 2012 hingga 22 September 2012 beliau menjabat sebagai Wakil Kepala Divisi Kredit, selanjutnya beliau menjabat sebagai Kepala Divisi Kredit dan saat ini beliau dipercaya menjabat sebagai Kepala Wilayah I.</p>', '20180117120753_SUCIPTO_1-1.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('61', null, 'Swasta Dwi Martono, SE', '<p>Beliau bergabung dengan PT. BPR Surya Yudha mulai tahun 2000 sebagai staf marketing, pada tahun 2005 beliau menjadi Account Officer di Kantor Pelayanan Kas Sapuran. Pada tahun 2006 beliau dipromosikan sebagai Kepala Seksi Kantor Pusat Kertek dan pada tahun 2010 beliau dipercaya menduduki Wakil Kepala Cabang Wonosobo serta selanjutnya beliau menjabat sebagai Kepala Cabang Wonosobo. Tahun 2014 hingga sekarang beliau dipercaya menjabat sebagai kepala Wilayah II yang membawahi Kantor Cabang Temanggung, Kantor Cabang Ngadirejo dan Kantor Cabang Parakan.</p>', '20180303211752_ATIK_HANDAYANI.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('62', null, 'Atik Handayani, SE', '<p>Lahir pada tahun 1976 di Wonosobo kewarganegaran Indonesia. Atik Handayani mengawali karirnya di PT. BPR Surya Yudha sejak tanggal 8 Maret 1999 sebagai staf Marketing, tahun 2000 dimutasikan ke Bagian Operasional sebagai staf Administrasi Kredit, tahun 2002 dimutasikan ke Bagian Accounting sebagai staf sampai dengan tahun 2005. Kemudian tahun 2006 beliau dipromosikan menjadi Wakasi PSPU sampai dengan tahun 2010, pada tahun 2011 dipromosikan menjadi Kasi Yr di Bagian PSPU. Pada bulan Februari 2012 beliau dipercaya managemen untuk menjabat sebagai Kepala Bagian PSPU (Personalia, Sekretariat, Pembukuan dan Umum) di Kantor Pusat. Dan mulai tanggal 25 April 2015 beliau menjabat sebagai Wakil Divisi Non Operasional. Pada tanggal 25 Mei 2016 beliau dipercaya managemen untuk menjabat sebagai Kepala Divisi Non Operasional.&nbsp;Kini beliau telah diangkat menjadi Direktur Umum yang Membawahkan Fungsi Kepatuhan, sejak bulan Oktober 2017. Dasar pengangkatan pada Akte Notaris No. 104&nbsp;tanggal 18 Oktober 2017, Masa jabatan berlaku hingga 16 Oktober 2022.</p>', '20180303211641_ATIK_HANDAYANI.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('63', null, 'Bagus Anom Warsito, SH', '<p>Bergabung dengan PT. BPR Surya Yudha sejak tahun 2003 sebagai staf marketing. Pada tahun 2006 beliau dipromosikan sebagai koordinator Pelayanan Kas Sapuran dan pada tahun 2008-2009 beliau menjabat sebagai Kepala Kantor Kas Sapuran. Pada pertengahan tahun 2009, beliau dipromosikan sebagai Wakil Kepala Cabang Sapuran dan tahun 2010 beliau dimutasikan sebagai Wakil Kepala Bagian Kredit di Kantor Pusat Kertek. Pada tahun 2011 beliau dimutasikan sebagai Wakil Kepala Bagian Internal Audit dan 2012-2014 dimutasikan sebagai Wakil Kepala Cabang Utama. Dengan adanya pembukaan Kantor Cabang Kaliwiro yang beropersional mulai bulan Juni 2016 beliau dipercaya untuk menduduki jabatan sebagai Kepala Cabang Kaliwiro. Pada bulan Januari 2017 beliau dimutasikan sebagai Kepala Cabang Utama. Dengan adanya kebutuhan organisasi, per tanggal 1 Maret 2018 beliau dimutasi ke Kantor Cabang Sapuran sebagai Kepala Cabang Yunior&nbsp;hingga saat ini.</p>', '20180117120933_BAGUS_ANOM_2.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('64', null, 'Haris Gunawan, SE', '<p>Haris Gunawan bergabung dengan PT. BPR Surya Yudha sejak tahun 2000 sebagai staf Marketing dan tahun 2002 sebagai Account Officer. Pada tahun 2004 beliau diangkat menjadi Wakil kepala Seksi Kredit PT. BPR Surya Yudha. Tahun 2005-2006 beliau menjabat sebagai Kepala Kas Pasar Induk Wonosobo. Pada pertengahan tahun 2008 beliau dimutasikan ke Cabang Temanggung menduduki jabatan sebagai Wakil kepala Cabang Temanggung. April 2013 beliau dipromosikan sebagai Kepala Cabang Temanggung. Pada tahun 2014 beliau di mutasikan dan menjabat sebagai Kepala Cabang Wonosobo hingga saat ini.</p>', '20180117120950_HARIS_1.JPG', null, '0', '0');
INSERT INTO `direksi` VALUES ('65', null, 'Winarno, SE', '<p>Tahun 2006 Winarno bergabung dengan PT. BPR Surya Yudha dan ditugaskan sebagai Staf Marketing Kantor Pusat Kertek. Pada tahun 2010 beliau diangkat menjadi Kepala Kas Kepil. Tahun 2012 beliau menjabat sebagai wakil kepala Cabang Utama. Sejak tahun 2014 beliau di promosikan menjadi kepala cabang Temanggung dan bulan Mei 2015 dipercaya menduduki Kepala Cabang Sapuran. Sejak tanggal 1 Maret 2018 beliau dimutasi ke Kantor Cabang Wonosobo menjadi Kepala Cabang Yunior sampai saat ini.</p>', '20180117121019_WINARNO_3-1.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('66', null, 'Mara Yoki Firmansyah', '<p>Bergabung dengan PT. BPR Surya Yudha sejak tahun 2008 sebagau staf EDP dan tahun 2010 dimutasikan ke Kantor Kas Pasar Wonosobo sebagai Account Officer. Pada bulan Juni 2011 menjabat sebagai Kepala Kas Pasar Wonosobo sampai dengan bulan April 2014 kemudian beliau dimutasikan ke Kantor Kas Selomerto dan menduduki Jabatan sebagai Kepala Kantor Kas Selomerto. Pada bulan Desember 2014 beliau dipromosikan sebagai Wakil Kepala Cabang Sapuran, tahun 2015 beliau dimutasikan ke Kantor Cabang Wonosobo sebagai Wakil Kepala Cabang hingga tahun 2016. Seiring dengan adanya pembukaan Kantor Cabang Selomerto yang beroperasional mulai tanggal 28 Desember 2016, beliau dipercaya menduduki Jabatan Kepala Cabang di Kantor Cabang Selomerto hingga saat ini</p>', '20180117121106_MARA_YOKI_2.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('67', null, 'Aris Saifudin', '<p>Bergabung dengan PT. BPR Surya Yudha sejak tahun 2003 sebagai staf marketing di Kantor Pelayanan Kas Pasar Wonosobo. Pada tahun 2006 beliau dimutasi menjadi staf marketing di Kantor Kas Kaliwiro. Pada tahun 2010 beliau dipromosikan menjadi Kepala Kantor Kas Wadaslintang dan pada tahun 2011 beliau dimutasi sebagai Kepala Kantor Kas Kaliwiro. Tahun 2012-2016 beliau dipromosikan sebagai Wakil kepala Cabang Wonosobo dan pada awal tahun 2017 beliau dipercaya menduduki Jabatan sebabai Kepala Cabang Kaliwiro hingga saat ini.</p>', '20180117121157_ARIS_SAIFUDIN_2.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('68', null, 'Bowo Wardiyanto', '<p>Mulai bergabung dengan PT. BPR Surya Yudha pada bulan Oktober 1999 dengan mengawali karir sebagai OB di Kantor Pusat Kertek. Dan pada tahun 2001 beliau di angkat sebagai staf untuk diperbantukan di bagian EDP hingga tahun 2002, kemudian pada tahun yang sama beliau di pindah ke bagian Marketing dan Account Officer di Cabang Utama Kertek hingga kurang lebih 3 tahun dan pada tahun 2005-2008 diangkat sebagai Koordinator cabang Utama. Pada tahun 2008-2009 beliau diangkat sebagai Wakil kepala Kantor Kas Sapuran, tahun 2009 beliau diangkat sebagai Kepala Kantor Kas Kepil dan pada bulan Agustus 2010 beliau kembali di pindah ke Sapuran menjabat sebagai Wakil Kepala cabang Sapuran. Pada bulan Mei 2015 beliau menjadi Kepala Cabang Temanggung hingga saat ini</p>', '20180303211836_ATIK_HANDAYANI.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('69', null, 'Mukhammad Budiyanto, A. Md', '<p>Mukhammad Budiyanto bergabung dengan PT. BPR Surya Yudha sejak tahun 2006 sebagai staf Marketing dan tahun 2009 sebagai Account Officer. Pada tahun 2010 beliau diangkat menjadi kepala Kas Garung PT. BPR Surya Yudha. Tahun 2012-2014 beliau menjabat sebagai Wakil Kepala Cabang Wonosobo. Pada akhir tahun 2014 beliau dimutasikan ke Cabang Utama, beliau menduduki jabatan sebagai kepala Cabang Utama dan sekarang beliau menjabat sebagai Kepala Cabang Ngadirejo. Sejak tanggal 1 Maret 2018 beliau dimutasi ke Kantor Cabang Temanggung sebagai Kepala Cabang Yunior hingga saat ini.</p>', '20180117121230_M_BUDIYANTO_1.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('70', null, 'Agus Kiswoto, ST', '<p>Agus Kiswoto S.T memiliki latarbelakang pendidikan teknik perminyakan UPN Yogakarta. Beliau bergabung dengan PT. BPR Surya Yudha sejak bulan Mei 2007 sebagai staff marketing. Pada tahun 2010 dengan adanya pembukaan Kantor Pelayanan Kas Paponan beliau dipromosikan sebagai Kepala Seksi Kantor Pelayanan Kas Paponan. Pada awal tahun 2011 beliau dimutasikan sebagai Kepala Pelayanan Kas Parakan sampai dengan tahun 2013 dan dipromosikan sebagai Wakil Kepala Cabang Sapuran. Pada tahun 2014 beliau dimutasi ke Kantor Cabang Temanggung sebagai Wakil Kepala Cabang. Dengan adanya pembukaan Kantor Cabang Parakan yang mulai beroperasional mulai tanggal 14 Oktober 2016 beliau dipercaya menduduki jabatan sebagai Kepala Cabang Parakan hingga saat ini.</p>', '20180117121250_AGUS_KISWOTO_2.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('71', null, 'Adhias Gumala, SE', '<p>Pada tanggal 24 Desember 1997 Adhias Gumala bergabung dengan PT. BPR Surya Yudha dengan mengawali karirnya sebagai staf Marketing. Pada tahun 1999 beliau diangkat menjadi staf EDP, tahun 2004 diangkat menjadi Wakasi EDP dan tahun 2006 menjadi Kasi EDP. Pada tahun 2008 beliau dimutasikan ke Cabang Temanggung dan dipercaya untuk menjabat sebagai Wakil Kepala Cabang Temanggung. Pada tahun 2009 dengan adanya peningkatan status Kas Sapuran menjadi Cabang Sapuran pada bulan September 2009, beliau diangkat sebagai Kepala Cabang Sapuran. Mulai tanggal 22 September 2012 beliau menjabat sebagai Kepala Bagian Kepatuhan dan per tanggal 25 Oktober 2013 hingga saat ini beliau menjabat sebagai Kepala Bagian Internal Audit PT. BPR Surya Yudha. Per tanggal 21 Desember 2017 beliau dipromosikan menjadi Kepala Satuan Kerja Audit Intern.</p>', '20180117121330_ADHIAS_G_2.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('72', null, 'Rabindra Akhmad Riza, SE', '<p>Rabindra Akhmad Riza memiliki latarbelakang pendidikan di Universitas Islam Indonesia tahun 2002. Rabindra Ahmad Riza bergabung dengan PT. BPR Surya Yudha tahun 2013 dengan mengawali karirnya sebagai staf marketing di Kantor Pusat Kertek. Pada tahun 2008 beliau diangkat menjadi Wakil Kepala Seksi Kantor Kas Pasar Wonosobo, tahun 2009 beliau diangkat menjadi Kepala Kantor Kas Pasar Wonosobo kurang lebih 2 tahun dan Juni 2011 beliau diangkat sebagai Kepala Kas Selomerto. Beliau menjabat sebagai Wakil Kepala Cabang Wonosobo mulai November 2011 sampai dengan September 2012. Pada 22 September 2012 beliau dipromosikan menjadi Kepala Cabang Utama Kertek dan mulai 1 Januari 2015 beliau dimutasi sebagai Kepala Bagian Kepatuhan, kini beliau dipercaya menjabat sebagai Kepala Bagian Kepatuhan dan Manajemen Risiko.&nbsp;Per tanggal 21 Desember 2017 beliau dipromosikan menjadi Kepala Satuan Kerja Kepatuhan dan Manajemen Risiko.</p>', '20180117121347_RABINDRA_1.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('73', null, 'Sri Rianasari Hermawati, SH', '<p>Bergabung dengan PT. BPR Surya Yudha sejak tahun 2006 sebagai marketing di bagian PHBKIS. Pada tahun 2008 diangkat sebagai Wakil Kepala Seksi di Kantor Cabang Temanggung dan pada bulan Januari 2011 dipromosikan sebagai Kepala Seksi pada cabang yang sama. Dengan dibukanya Kantor Cabang Ngadirejo, kemudian pada bulan Mei 2011 beliau dipromosikan sebagai Wakil Kepala Cabang Ngadirejo. Selanjutnya pada bulan Februari 2012 beliau dimutasikan ke Kantor Cabang Temanggung sebagai Wakil Kepala Cabang dan selanjutnya pada bulan Oktober 2012 beliau ditugaskan sebagai Wakil Kepala Bagian Kepatuhan Pengendalian Risiko di Kantor Pusat PT. BPR Surya Yudha. Bulan April 2014, beliau kemudian ditugaskan sebagau Wakil Kepala Cabang di Kantor Cabang Temangung dan sejak bulan Oktober 2015 hingga saat ini beliau dipercaya menjabat sebagai Kepala Bagian Dana.<br />Sehubungan dengan kebutuhan STO, per tanggal 25 Mei 2018 beliau mutasi ke Bagian Satuan Kerja Audit Inter SKAI) sebagai Wakil Kepala Bagian Yr</p>', '20180117121413_RIANASARI_H_1.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('74', null, 'Fitria Yulianingsih, SE', '<p>Bergabung dengan PT. BPR Surya Yudha sejak tahun 2002 sebagai Staf Marketing di Kantor Kas Pasar Wonosobo. Pada tahun 2009 dimutasi ke Kantor Kas Selomerto dan bulan Agustus 2010 dimutasi ke Kantor Cabang Wonosobo. Kemudian pada Bulan Oktober 2010 beliau dimutasi ke Kantor Pusat Kertek sebagai staf bagian Pembukuan. Diangkat menjadi Wakil Kepala Seksi Yunior pada bulan Februari 2012, tahun 2014-2015 menjabat sebagai Kepala Seksi Bagian Personalia, Pembukuan dan Pendidikan. Pada bulan April tahun 2015 dipromosikan sebagai Wakil Kepala Bagian Pembukuan dan April 2016 beliau dipercaya menduduki jabatan sebagai Kepala Bagian Pembukuan Kantor Pusat.</p>', '20180303210912_FITRIA_YULIANINGSIH.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('75', null, 'Nova Artanto Mahardani, A. Md', '<p>Bergabung dengan PT. BPR Surya Yudha sejak tahun 2006 sebagai Back Office di Kantor Cabang Temanggung. Pada tahun 2012 diangkat sebagai Wakil Kepala Seksi Bagian PDE di Kantor Pusat Kertek dan pada tahun 2013 dipromosikan sebagai Kepala Seksi pada kantor yang sama. Pada April 2015 beliau dipromosikan sebagai Wakil Kepala Kepala Bagian PDE, April 2016 beliau dipercaya menjabat sebagai Kepala Bagian PDE. Dengan digabungnya bagian EDP dan EBD maka beliau dipercaya membawahi bagian tersebut hingga saat ini.</p>', '20180117121532_NOVA_ARTANTO_2.JPG', null, '1', '0');
INSERT INTO `direksi` VALUES ('76', null, 'Slamet Riyadi, A.Md.', '<p>Lahir pada tahun 1980 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir D3 Bisnis Intrnasional Universitas Jendereal Soedirman. Slamet Riyadi, A.Md bergabung dengan BPR Bank Surya Yudha pada Maret 2005 sebagai Staf Kas Singamerta. Pada bulan Oktober 2009 dipercaya sebagai Wakil Kepala Kas Tunggara. Pada bulan Oktober 2011 dipromosikan sebagai Kepala Kas Banyumas. Pada bulan November 2011 dmutasi sebagai Kepala Kas Tunggara. Pada bulan April 2015 dipromosikan sebagai Wakil Kepala Cabang Singamerta. Saat ini beliau menjabat sebagai Kepala Cabang Madukara sejak 20 Juli 2017. &nbsp;</p>', '20180508114518_mamet.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('77', null, 'Rani Purwandari, S.E.', '<p>Lahir pada tahun 1985 di Wonosobo dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan terakhir S1 Ekonomi &nbsp;STIE Widya Wiwaha Yogyakarta. Rani Purwandari, S.E. bergabung dengan BPR Bank Surya Yudha sejak bulan Oktober 2007 sebagai Administrasi Tabungan dan Deposito Bagian Operasional. Pada bulan Maret 2008 dimutasi ke Bagian Sekretariat Kantor Pusat. Pada bulan Maret 2013 dipromosikan menjadi Wakil Kepala Seksi Bagian Sekretariat. Pada bulan April 2016 beliau kembali dipromosikan menjadi Kepala Seksi Bagian Sekretariat. Saat ini beliau menjabat sebagai Wakil Kepala Bagian Sekretariat sejak 14 September 2017.</p>', '20180511164851_rani_new.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('78', null, 'Tri Asiyani', '<p>Lahir pada tahun 1974 di Banjarnegara dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan terakhir SMA Cokro Banjarnegara. Tri Asiyani&nbsp;bergabung dengan BPR Bank Surya Yudha pada bulan Juli 1994 sebagai Marketing. Pada bulan April 1997 dimutasi menjadi Administrasi Kredit Kantor Pusat. Pada bulan &nbsp;Juli 2001 dimutasi ke Bagian Pembukuan, Sekretariat dan Personalia (PSP). Pada bulan November 2001 dimutasi ke Bagian Operasional. Pada bulan Januari 2002 beliau dipromosikan sebagai Kepala Seksi Operasional. Pada bulan Mei 2009 beliau dipromosikan sebagai Wakil Kepala Bagian Operasional. Pada bulan Januari 2014 beliau dimutasi ke Bagian Kepatuhan sebagai Wakil Kepala Bagian yang saat ini berubah nama menjadi Bagian Satuan Kerja Kepatuhan dan Manajemen Risiko.</p>', '20180508101703_nani.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('79', null, 'Rani Purwandari, S.E.', '', null, null, '0', '0');
INSERT INTO `direksi` VALUES ('80', null, 'Tri Asiyani', '<p>Lahir pada tahun 1974 di Banjarnegara dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan terakhir SMA Cokro Banjarnegara. Tri Asiyani&nbsp;bergabung dengan BPR Bank Surya Yudha pada bulan Juli 1994 sebagai Marketing. Pada bulan April 1997 dimutasi menjadi Administrasi Kredit Kantor Pusat. Pada bulan &nbsp;Juli 2001 dimutasi ke Bagian Pembukuan, Sekretariat dan Personalia (PSP). Pada bulan November 2001 dimutasi ke Bagian Operasional. Pada bulan Januari 2002 beliau dipromosikan sebagai Kepala Seksi Operasional. Pada bulan Mei 2009 beliau dipromosikan sebagai Wakil Kepala Bagian Operasional. Pada bulan Januari 2014 beliau dimutasi ke Bagian Kepatuhan sebagai Wakil Kepala Bagian yang saat ini berubah nama menjadi Bagian Satuan Kerja Kepatuhan dan Manajemen Risiko.</p>', '20180508103543_IMG_5005+.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('81', null, 'Khrisna Adhy Purba', '<p>Lahir pada tahun 1980 di Sleman dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir SMU Taman Madya Jetis Yogyakarta. Khrisna Adhy Purba&nbsp;bergabung dengan BPR Bank Surya Yudha pada bulan Februari 2003 sebagai Staf Bagian Umum. Pada bulan September 2003 dimutasi ke Bagian <em>Electronic Data Processing</em>&nbsp;(EDP). Pada bulan Oktober 2012 dipromosikan sebagai Kepala Seksi Bagian Teknologi Informasi. Pada bulan April 2015 dimutasi ke Bagian<em>&nbsp;</em><em>Electronic Banking and Product Development </em>sebagai Kepala Seksi. Beliau menjabat sebagai Wakil Kepala Bagian <em>Electronic Banking and Product Development</em>&nbsp;sejak bulan Juni 2016. Saat ini beliau menjabat sebagai Kepala Bagia EBD sejak 13 April 2018.</p>', '20180519111900_WhatsApp_Image_2018-05-18_at_09_22_55_1.jpeg', null, '1', '0');
INSERT INTO `direksi` VALUES ('82', null, 'Aris Purwanto, S.E.', '<p>Lahir pada tahun 1974 di Banjarnegara dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan S1 Ekonomi Universitas Jenderal Soedirman Purwokerto. Aris Purwanto, S.E. bergabung dengan BPR Bank Surya Yudha pada tahun 1999 sebagai Marketing di Cabang Mandiraja. Pada Februari 2006 dipercaya sebagai Wakil Kepala Seksi Kas Pasar Besar. Pada Juni 2006 dipromosikan sebagai Wakil Kepala Cabang Purbalingga. Pada Januari 2008 dimutasi ke Cabang Purwonegoro sebagai Wakil Kepala Cabang. Berikutnya dimutasi ke Cabang Purbalingga pada Juli 2008. Pada April 2014 dipercaya sebagai Wakil Kepala Cabang Utama. Pada agustus 2014 dimutasi ke Cabang Singamerta sebagai Wakil Kepala Cabang. Pada Maret 2015 dipercaya menjabat sebagai Wakil Kepala Bagian Dana Kantor Pusat. Beliau dipercaya sebagai Kepala Bagian Dana sejak 30 Oktober 2017. &nbsp;</p>', '20180206132114_Aris_P.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('83', null, 'Aulia Dewi Rarasratri, A.Md.', '<p>Lahir pada tahun 1983 di Banjarnegara dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan terakhir D3 Bahasa Inggris Universitas Jenderal Soedirman Purwokerto. Aulia Dewi Rarasratri, A.Md. bergabung dengan BPR Bank Surya Yudha pada Maret 2005 sebagai Teller di Bagian Operasional Kantor Pusat. Pada Mei 2005 dimutasi ke Kantor Kas Singamerta sebagai Kasir dan Teller.Pada bulan Oktober 2006 dimutasi ke Bagian Pembukuan Kantor Pusat. Pada bulan Februari 2013 dimutasi ke Kantor Cabang Utama sebagai petugas Personalia, Umum, Sekretariat, Pembukuan dan Operasional (PUSPO). Pada bulan Februari 2012 dipercaya sebagai Kepala Seksi Bagian Pembukuan. Beliau menjabat sebagai Wakil Kepala Bagian <em>Treasury</em>&nbsp;sejak bulan April 2017. Saat in beliau menjabat sebagai Kepala Bagian Treasury sejak tanggal 13 April 2018.</p>', '20180521082626_DEWI_TRS.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('84', null, 'n', '', '20180206132011_Tosa.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('85', null, 'Wahyu Setiyo Utomo, S.Pd.', '<p>Lahir pada tahun 1986 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1 Pendidikan Matematika Universitas Muhammadiyah Purwokerto. Wahyu Setiyo Utomo, S.Pd.&nbsp;Bergabung dengan BPR Bank Surya Yudha pada bulan &nbsp;November 2011 di Bagian Personalia. Pada bulan Agustus 2015 dipromosikan sebagai Wakil Kepala Seksi Bagian Personalia dan Pendidikan. Saat ini beliau menjabat sebagai Kepala Seksi Bagian Pendidikan sejak Mei 2017.</p>', '20180215143549_wahyu.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('86', null, 'Wisnu Kumara Sakti', '<p>Lahir pada tahun 1980 di Magelang&nbsp;dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir SMA N 1 Prambanan Klaten. Wisnu Kumara Sakti bergabung dengan BPR Bank Surya Yudha sejak bulan Maret 2014 sebagai Staf Bagian Teknologi Informasi Kantor Pusat. Pada bulan April 2015 dipromosikan sebagai Wakil Kepala Seksi Bagian <em>Electronic Banking and Product Development</em>. Pada bulan Juni 2016 dipercaya sebagai Wakil Kepala Seksi Bagian <em>Marketing Communication</em>&nbsp;Kantor Pusat.</p>', null, null, '0', '0');
INSERT INTO `direksi` VALUES ('87', null, 'Yuyun Dwi Astuti, SE', '<p>Lahir pada tahun 1982 di Wonosobo. Memiliki latar belakang pendidikan terakhir S1 Ekonomi Akuntansi di Universitas Muhammadiyah Surakarta pada tahun 2005. Beliau bergabung dengan PT. BPR Surya Yudha sejak bulan November 2008 di Bagian Personalia. Pada tahun 2016&nbsp;dipromosikan sebagai Kepala Seksi Bagian Personalia. Saat ini beliau menjabat sebagai Wakil Kepala Bagian Personalia dan Pendidikan&nbsp;Sejak tahun 2017.</p>', '20180304193145_yuyun.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('88', null, 'Heni Tri Supiatun, SE', '<p>Heni Tri Supiatun, SE lahir di WOnosobo tanggal 9 Maret 1983 bergabung dengan PT. BPR Surya Yudha sejak tahun 2006 sebagai staf marketing. dan tahun 2009 sebagai Pembukuan Kas. Pada Tahun 2010 bulan Agustus beliau dimutasi ke Kantor Cabang Wonosobo sebagai Pembukuan induk. Tahun 2013 beliau dimutasi menjadi PUSPO di kanto Cabang Sapuran dan pada bulan Oktober 2015 beliau dipercaya untuk menduduki jabatan sebagai Kepala Seksi Yunior Bagian Operasional. Selanjutnya pada bulan April 2016 beliau menduduki jabatan sebagai Wakil Kepala Bagian Operasional dan ATM Kantor Pusat. Pada tahun 2017 operasional dan ATM menjadi bagian yang berbeda sehingga beliau menjabat sebagai Wakil Kepala Bagian Operasional. Pada Tanggal 21 Desember 2017 beliau menjabat sebagai Wakil Kepala Bagian Yunior Treasury dan Umum (TU) Kantor Pusat sampai saat ini.</p>', '20180303212022_HENI_TRI_SUPIATUN.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('90', null, 'Wisnu Praditya', '<p>ini hanya data testing</p>', '20181217101624_CU_2.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('91', null, 'Wisnu Praditya', '<p>ini hanya data testing</p>', '20180208170758_CU_2.jpg', null, '0', '0');
INSERT INTO `direksi` VALUES ('92', null, 'Johan Prasetyo', '<p>Lahir pada tahun 1984 di Purbalingga dengan kewarganegaraan Indonesia.&nbsp;Memiliki latar belakang pendidikan terakhir SMK YPT 2 Purbalingga. Johan Prasetyo bergabung dengan BPR Bank Surya Yudha pada Mei 2007 sebagai Marketing Kas Rembang. Pada Desember 2011 dipercaya sebagai Wakil Kepala Kas Karangmoncol. Pada tahun 2013 dipromosikan sebagai Kepala Kas Karangmoncol. Pada bulan Oktober 2015 dipromosikan menjadi Wakil Kepala Cabang Rembang. Saat ini beliau menjabat sebagai Kepala Cabang Rembang sejak 06 Februari 2018.</p>', '20180508103626_jopras.png', null, '0', '0');
INSERT INTO `direksi` VALUES ('93', null, 'Mardhianto Eka Pratomo, S.E.', '<p>Lahir pada tahun 1991 di Banjarnegara, berpendidikan terakhir S1 Manajemen Ekonomi Universitas Widaya Wiwaha Yogyakarta. Mardhianto Eka Pratomo, S.E. bergabung dengan BPR Bank Surya Yudha pada Agustus 2010 sebagai Marketing Cabang Utama. Pada bulan Oktober 2012 dipercaya sebagai AO Cabang Utama. Pada bulan Mei 2014 dipromosikan sebagai Wakil Kepala Seksi Cabang Utama. Pada bulan September 2015 dipromosikan menjadi Wakil Kepala Cabang Utama. Pada bulan Mei 2016 dimutasi ke Kantor Cabang Purbalingga sebagai Wakil Kepala Cabang dan ke Cabang Purwokerto pada bulan Maret 2017. Saat ini beliau menjabat sebagai Kepala Cabang Purwokerto sejak 19 Februari 2018.</p>', '20180508101536_Picture1.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('94', null, 'Gilang Purnomo', '<p>Lahir pada tahun 1988 di Wonosobo dengan kewarganegaraan Indonesia. Memiliki pendidikan terakhir&nbsp;SMA N 1 Bawang lulus pada tahun 2006. Memulai karir di BPR Bank Surya Yudha bulan&nbsp;Agustus 2006 sebagai Marketing. Pada tahun 2010 dipercaya sebagai Kepala Seksi Kredit Cabang Purwonegoro. Pada tahun 2011 dipercaya sebagai Kepala Kas Wanadri. Pada tahun 2012 dimutasi sebagai Kepala Kas Bawang. Pada tahun 2017 dipromosikan sebagai Wakil Kepala Cabang Wanadadi. Saat ini beliau menjabat sebagai Kepala Cabang Dieng sejak 05 Maret 2018.</p>', '20180508104300_gilang.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('95', null, 'Agung Nugroho Saefurochman', '<p>Lahir pada tahun 1981 di Banjarnegara. Memiliki latar belakang pendidikan terakhir SMA N 1 Karangkobar. Agung Nugroho Saefurochman bergabung dengan BPR Bank Surya Yudha pada bulan Mei 2006 sebagai Marketing. Pada bulan Maret 2012 dipercaya sebagai Wakil Kepala Kas Wanayasa. Pada bulan Maret 2013 dimutasi ke Kantor Cabang Karangkobar sebagai Wakil Kepala Seksi. Pada bulan Maret 2014 dipromosikan sebagai Kepala Kas Wanayasa. Pada bulan Maret 2017 dipromosikan sebagai Wakil Kepala Cabang Kalibening. Pada bulan Maret 2018 dipercaya sebagai Ketua Kelompok Kerja Wanayasa. Saat ini beliau menjabat sebagai Kepala Cabang Wanayasa sejak 08 Maret 2018.</p>', '20180508104336_nugroho.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('96', null, 'Leonard Paul Nangin', '<p>Lahir pada tahun 1958 di Jakarta, memiliki latar belakang pendidikan terkahir di SMU Negeri 24 Jakarta. Leonard Paul Nangin bergabung dengan BPR Bank Surya Yudha sejak bulan Oktober 2017 sebagai Kepala Seksi Bagian SKAI. Pada tanggal 12 Februari 2018 beliau dipromosikan sebagai Wakil Kepala Bagian SKAI TIM B. Saat ini beliau menjabatn sebagai Kepala Bagian SKAI TIM B sejak tanggal 22 Februari 2018.</p>', '20180508101428_leo.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('97', null, 'Fajar Mugiyanto, S. Pd', '<p>Mulai bergabung dengan PT. BPR Surya Yudha pada bulan Maret 2010 dengan mengawali karir sebagai Marketing di Kantor Cabang Utama. Dan pada tahun 2011 beliau di angkat sebagai Account Officer Kantor Cabang Utama sampai tahun 2013, di tahun yang sama diangkat menjadi Wakil Kepala Seksi dan pada tahun 2014 diangkat menjadi Kepala Kas Randusari kemudian pada tahun 2015 di mutasi menjadi Kepala Seksi Kantor Cabang Utama, pada tahun 2015-2016 beliau menjabat sebagai Kepala Kas Kalikajar&nbsp; dan pada tahun 2017 diangkat sebagai Wakil Kepala Cabang Sapuran, pada bulan Maret 2018 beliau diangkat sebagai Kepala cabang Utama hingga saat ini.</p>', '20180417174055_IMG-20180412-WA0126.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('98', null, 'Mukhammad Lutfi, SE', '', '20180417174145_IMG-20180412-WA0088.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('99', null, 'Januar Dwi Saputra', '<p>Januar Dwi Saputra bergabung dengan PT. BPR Surya Yudha sejak tahun 2012 sebagai staf Marketing Cabang Utama dan pada tahun yang sama sebagai Account Officer. Pada tahun 2016 beliau diangkat menjadi Wakil kepala Seksi Kredit Cabang Utama . Tahun 2017 beliau menjabat sebagai Kepala Kas Kalikajar . Pada bulan November tahun 2017 beliau dipromosikan ke Cabang Utama menduduki jabatan sebagai Wakil kepala Cabang. Pada bulan Maret 2018 beliau di mutasikan dan menjabat sebagai Kepala Cabang Parakan hingga saat ini.</p>', '20180417174206_IMG-20180412-WA0074.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('100', null, 'Nuryanto', '', '20180417174221_IMG-20180412-WA0118.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('101', null, 'Iwan Widyawan Dwi Putranto, A. Md', '<p>Iwan Widyawan Dwi Putranto memiliki latar belakang pendidikan D3 Perhotelan Politeknik API Yogyakarta. Beliau bergabung dengan PT BPR Surya Yudha sejak tahun 2006 sebagai Staff Marketing di Kantor Cabang Temanggung. Tahun 2011 dipromosikan sebagai Kepala Pelayanan Kas Paponan di Kantor Cabang Temanggung. Tahun 2013 dimutasi ke Bagian Internal Audit di kantor Pusat Wonosobo sebagai Wakil Kepala Seksi. Ditahun 2014 dipromosikan menjadi Kepala Seksi Bagian Internal Audit dikantor yang sama. Tanggal 5 April 2018 dipromosikan menjadi Wakil Kepala Bagian Satuan Kerja Audit Intern (SKAI). Pada tanggal 3 Mei 2018 dipromosikan kembali sebagai Kepala Bagian Satuan Kerja Audit Intern (SKAI) di Kantor Pusat Wonosobo hingga saat ini.</p>', '20180417174237_IMG-20180411-WA0095.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('102', null, 'Rina Yuliyanti, S.Pd.', '<p>Lahir pada tahun 1984 di Banjarnegara dengan kewarganegaraan Indonesia. Memiliki latar belakang pendidikan terakhir S1 Pendidikan Bahasa Perancis di Universitas Negeri Yogyakarta. Bergabung dengan BPR Bank Surya Yudha pada November 2009 sebagai Staf Bagian Operasional dan EDP. Pada bulan Maret 2010 di mutasi sebagai Staf Administrasi Bagian PHBKIS. Pada bulan Juli 2014 dimutasi ke Bagian Pembukuan. Pada bulan Desember 2014 dimutasi ke Bagian Personalia. Pada bulan Agustus 2015 dipromosikan sebagai Wakil Kepala Seksi Bagian Personalia dan Pendidikan. Pada bulan April 2016 dipromosikan sebagai Kepala Seksi Bagian Personalia. Saat ini beliau menjabat sebagai Wakil Kepala Bagian <em><em>Compensation &amp; Benefit Department</em></em>&nbsp;sejak 13 April 2018.</p>', '20180519103007_yulia.png', null, '1', '0');
