INSERT INTO `direksi` VALUES ('110', null, 'Sigit Kandiwaras', '', '20180508114649_SIGIT.JPG', null, '0', '0');
INSERT INTO `direksi` VALUES ('111', null, 'Ginanjar Dewantoro, A.Md.', '<p>Lahir pada tahun 1991&nbsp;di Banjarnegara&nbsp;dengan kewarganegaraan Indonesia. Memiliki pendidikan terakhir D3 Politeknik Negeri Malang&nbsp;lulus pada tahun 2011. Memulai karir di BPR Bank Surya Yudha bulan Januari&nbsp;2012&nbsp;sebagai Staf Teknologi Informasi. Pada tahun 2014&nbsp;dipercaya sebagai Wakil Kepala Seksi Bagian Teknologi Informasi. Pada tahun 2016 dipromosikan sebagai Kepala Seksi Bagian Electronic Data Processing (EDP). Pada tanggal 13 Juni 2016 dipromosikan sebagai Wakil Kepala Bagian EDP. Saat ini beliau menjabat sebagai Kepala Bagian EDP sejak 13 April 2018.</p>', '20180508103820_anjar.png', null, '1', '0');
INSERT INTO `direksi` VALUES ('112', null, 'Galih Setyo Wicaksono, S.E.', '', '20180508114921_galih.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('113', null, 'Samsuri', '<p>Menjabat sebagai Kepala Bagian Satpam berdasarkan SK No. 411/DIR/HRD/VII/18 tanggal 23 Juli 2018. Lahir di Demak, 11 Juni 1960. Merupakan Pensiunan Kepolisian Negara Repuplik Indonesia (POLRI) . Bergabung dengan BSY pada bulan Juli 2018.</p>', '20180726105658_samsuri_website.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('114', null, 'Suroso, S.E.', '<p>Menjabat sebagai Kepala Bagian Satuan Kerja Audit Intern Tim B berdasarkan SK No. 398/DIR/HRD/V/18&nbsp;tanggal 25&nbsp;Mei&nbsp;2018. Lahir di Banjarnegara, 29&nbsp;September&nbsp;1974. Memiliki latar belakang pendidikan terakhir S1 Ekonomi&nbsp;di Universitas Pembangunan Nasional Yogyakarta lulus pada tahun 1998. Bergabung dengan BSY pada bulan April&nbsp;1998.</p>', '20180628152759_roso.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('115', null, 'Tanti Indrayani, A.Md.', '<p>Menjabat sebagai Kepala Bagian PSU Wilayah VIII&nbsp;berdasarkan SK No. 388/DIR/PRS/V/18&nbsp;tanggal 9&nbsp;Mei&nbsp;2018. Lahir di Wonosobo, 2&nbsp;Agustus&nbsp;1978. Memiliki latar belakang pendidikan terakhir D3 Jurusan Sekretariat Universitas Jenderal Soedirman Purwokerto&nbsp;lulus pada tahun 2000. Bergabung dengan BSY pada bulan&nbsp;Juli&nbsp;2001.</p>', '20180628152834_tanti.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('116', null, 'Agustinus Eva Soekmawati, SE', '<p>Beliau bergabung dengan PT BPR Surya Yudha sejak bulan Desember 2012 sebagai staf marketing danna di Kantor Cabang Wonosobo. Pada bulan Oktober 2015 beliau menjadi staf admin Dana di Kantor Pusat.&nbsp;<br />Satu tahun kemudian (Oktober 2016) beliau dipindah tugas dan mutasi ke Marketing Dana Kantor Cabang Sapuran dan bulan Februari 2017 di promosikan menjadi Wakil Kepala Seksi Dana Kantor Cabang Sapuran. Dengan kinerja yang baik, beliau dipromosikan menjadi Kepala Seksi Dana Kantor Cabang Wonosobo dan pada bulan Juni 2018 beliau diberikan amanah untuk menjabat sebagau Wakil Kepala Bagia Dana yang berkantor di Kantor Pusat.&nbsp;</p>', null, null, '1', '0');
INSERT INTO `direksi` VALUES ('117', null, 'Prawoto, S.E.', '<p>Menjabat sebagai Kepala Bagian Kredit Kendaraan Bermotor dan Asuransi&nbsp;berdasarkan SK No. 419/DIR/HRD/VIII/18 tanggal 27 Agustus 2018. Lahir di Wonosobo, 29 Mei 1986. Memiliki latar belakang pendidikan terakhir S1 Ekonomi di Universitas Widya Wiwaha Yogyakarta lulus pada tahun 2016. Bergabung dengan BSY pada bulan Maret 2010.</p>', '20180830130136_PRWOTO.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('118', null, 'Wahyono Dwi Kristanto, A.Md', '<p>Menjabat sebagai Kepala Cabang Rembang berdasarkan SK No. 412/DIR/HRD/VIII/18 tanggal 6 Agustus 2018. Lahir di Banyumas, 19&nbsp;September&nbsp;1978. Memiliki latar belakang pendidikan terakhir D3 di AA YKPN Yogyakarta lulus pada tahun 2002. Bergabung dengan BSY pada bulan November 2004.</p>', '20180907140140_wahyono.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('119', null, 'Arif Amrizal', '<p>Lahir di Banjarnegara pada tanggal 28 Mei 1998</p>', null, null, '0', '0');
INSERT INTO `direksi` VALUES ('120', null, 'Sarwono', '', null, null, '1', '0');
INSERT INTO `direksi` VALUES ('121', null, 'Ikhwan Rudiyanto, A.Md.', '', '20181008164021_ikhwan.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('122', null, 'Dicky Firman Tarigan', '', '20181031192929_dicky_NEW.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('123', null, 'Sukirman, A.Md.', '<p>Menjabat sebagai Kepala Cabang Kaligondang berdasarkan SK No. 463/DIR/HRD/XI/18 tanggal 19 November 2018. Lahir di Purbalingga, 30&nbsp;Mei 1985. Memiliki latar belakang pendidikan terakhir D3&nbsp; Universitas Jenderal Soedirman Purwokerto&nbsp;lulus pada tahun 2006. Bergabung dengan BSY pada bulan&nbsp;Juli&nbsp;2008.</p>', '20181130213116_kirman.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('124', null, 'Yoga Prasetya Giri Saputra, S.H.', '<p>Menjabat sebagai Kepala Cabang Baturraden&nbsp;berdasarkan SK No. 01/DIR/HRD/I/19 tanggal 5&nbsp;Januari&nbsp;2019. Lahir di Purwokerto, 5&nbsp;Januari&nbsp;1981. Memiliki latar belakang pendidikan terakhir S1 Hukum&nbsp;Universitas Jenderal Soedirman Purwokerto&nbsp;lulus pada tahun 2006. Bergabung dengan BSY pada bulan Mei&nbsp;2007.</p>', '20190206082408_yoga_btd.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('125', null, 'Ahmad Zaenudin', '<p>Menjabat sebagai Kepala Cabang Pasar Besar berdasarkan SK No. 07/DIR/HRD/I/19 tanggal 1 Februari 2019. Lahir di Banjarnegara, 7 Oktober 1989. Memiliki latar belakang pendidikan terakhir MAN 2 Banjarnegara lulus pada tahun 2007. Bergabung dengan BSY pada bulan Mei&nbsp;2010.</p>', '20190208130823_zaenu.jpg', null, '1', '0');
INSERT INTO `direksi` VALUES ('126', null, 'Sandhy Wijaya', '<p>Menjabat sebagai Kepala Cabang Sragi&nbsp;berdasarkan SK No. 17/DIR/HRD/II/19 tanggal 6 Februari 2019. Lahir di Banjarnegara, 4 Juni 1988. Bergabung dengan BSY pada bulan Desember&nbsp;2008.</p>', null, null, '1', '0');
INSERT INTO `direksi` VALUES ('127', null, 'Aan Adriana, A.Md.', '<p>Menjabat sebagai Kepala Bagian SKAI Tim B berdasarkan SK No. 20/DIR/HRD/III/19 tanggal 1 Maret 2019. Lahir di Banjarnegara, 14 Desember 1971. Memiliki latar belakang pendidikan terakhi D3 STMIK AKAKOM Yogyakarta lulus pada tahun 1996.Bergabung dengan BSY pada bulan&nbsp;Maret 2003.</p>', null, null, '1', '0');
