INSERT INTO `sub_produk` VALUES ('1', '1', 'Tabungan Surya ', '<p>Produk tabungan dengan bunga bersaing yang dihitung berdasarkan saldo harian dengan sistem <em>tiering </em>dengan keunggulan tanpa biaya administrasi bulanan,&nbsp;dijamin oleh Lembaga Penjamin Simpanan (LPS) milik Pemerintah dan dikelola secara profesional. Disajikan dengan memberikan pelayanan personal dengan sikap antusias, niat baik, integritas dan tulus agar dapat memberikan kepuasan dan perhatian terbaik bagi setiap nasabah.</p>', '<p>Ketentuan:</p><p>1.&nbsp;&nbsp;&nbsp;&nbsp; Setoran awal minimal Rp. 25.000,-</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Setoran selanjutnya minimal Rp. 20.000,-</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Saldo pengendapan tabungan minimal Rp. 25.000,-</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Administrasi penggantian buku hilang, habis, cacat/rusaknya buku tabungan akan dikenakan biaya sebesar Rp. 5.000,-</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Biaya penutupan rekening Rp. 10.000,-</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Tidak diasuransikan.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Diikutsertakan undian berhadiah.</p>', '2', '1', '0', '20180119164228_Tabungan_Surya.png');
INSERT INTO `sub_produk` VALUES ('2', '1', 'Tabungan Surya Berhadiah', '<p>Tabungan Surya Berhadiah adalah inovasi&nbsp;produk dari Tabungan Surya dimana produk ini bunga tabungan dibagi dua yaitu minimal&nbsp;0,25 % masuk kedalam rekening dan bunga sisanya bisa&nbsp;diterima saat pembukaan rekening baik berupa uang tunai maupun barang lainnya sesuai dengan jangka waktu pengendapan tabungan yang dipilih yaitu 3 bulan, 6 bulan atau 12 bulan.</p>', '<p>1.&nbsp;&nbsp;&nbsp;&nbsp; Penabung harus melakukan penyetoran secara tunai/<strong><em>fresh money </em></strong>sesuai dengan nominal dan jangka waktu yang akan dipilih.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Dapat diberlakukan untuk rekening baru ataupun rekening yang sudah ada.</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Jangka waktu perjanjian adalah 3 bulan, 6 bulan, 12 bulan.</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Tabungan Surya berhadiah tidak dapat diambil sewaktu-waktu, pengambilan hanya dapat dilakukan pada saat jatuh tempo sesuai dengan perjanjian awal yang telah ditandatangani oleh nasabah.</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Apabila sebelum jatuh tempo setoran tersebut diambil, maka akan dikenakan finalty yang diperhitungkan dari&nbsp; hadiah (perhitungan dari jangka waktu yang belum terpenuhi) ditambah pajak yang dibayarkan.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Tabungan akan diblokir melalui sistem sebesar nominal yang disepakati dan jangka waktu sesuai perjanjian awal pada saat mengikuti kepesertaan Tabungan Surya Berhadiah.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Jika Tabungan Surya Berhadiah dilakukan dengan menggunakan buku tabungan yang sudah ada, maka nasabah hanya mengisi formulir keikutsertaan Tabungan Surya Berhadiah.</p><p>8.&nbsp;&nbsp;&nbsp;&nbsp; Jika Tabungan Surya Berhadiah dibuka dengan rekening baru, maka nasabah harus mengisi kelengkapan dokumen pembukaan rekening.</p><p>9.&nbsp;&nbsp;&nbsp;&nbsp; Buku tabungan akan dibubuhi stempel &ldquo;Berhadiah&ldquo;, dan akan dicantumkan nominal yang diblokir, jangka waktu serta tanggal jatuh tempo perjanjian, dengan dilengkapi paraf Petugas dan Pimpinan pada cover dalam buku tabungan.</p><p>10.&nbsp; Hadiah dapat langsung diterima sesuai dengan jenis dan harga yang disepakati.</p><p>11.&nbsp; Dapat dipergunakan sebagai jaminan kredit dengan jangka waktu minimal sesuai dengan jatuh tempo perjanjian.</p><p>12.&nbsp; Tabungan Surya Berhadiah tidak berlaku permanen, hanya berlaku pada waktu tertentu sesuai dengan promo yang akan diterbitkan.</p><p>13.&nbsp; Bebas biaya administrasi.</p><p>14.&nbsp; Tidak diasuransikan.</p><p>15.&nbsp; Tidak diikutsertakan undian berhadiah.</p>', '2', '1', '0', '20180209173805_Tabungan_Surya.png');
INSERT INTO `sub_produk` VALUES ('3', '2', 'Deposito Umum', '<p>Deposito merupakan simpanan berjangka yang dapat diambil atau dicairkan pada saat jatuh tempo. Dengan pilihan jangka waktu yaitu 1, 3, 6, dan 12 bulan serta dapat perpanjangan secara otomatis dengan suku bunga yang kompetitif bisa dibayarkan secara tunai, pemindahbukuan rekening tabungan, transfer maupun gabung pokok.</p>', '<p>1.&nbsp;&nbsp;&nbsp;&nbsp; Bilyet Deposito tidak dapat diperdagangkan/dipindahkan haknya, dan dapat dibayarkan pada saat jatuh tempo kepada pemilik deposito dengan menyerahkan asli Bilyet Deposito.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Setoran awal minimal Rp. 1.000.000,-</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Bunga tidak kena pajak apabila saldo dan atau gabungan deposito dan tabungan dalam satu nama tidak melebihi Rp. 7.500.000,-</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Administrasi penggantian Bilyet Deposito hilang dikenakan biaya sebesar Rp. 5.000,-<strong><em>(diluar biaya meterai).</em></strong></p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Deposito yang tidak diperpanjang secara otomatis bila telah jatuh tempo dan belum ada keterangan dari deposan, maka Bank diberi kuasa untuk memperpanjang deposito sesuai dengan jangka waktu perjanjian sebelumnya dan suku bunga sesuai dengan suku bunga yang berlaku saat ini.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Diikutsertakan undian berhadiah.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Ketentuan pembebanan biaya pinalty pencairan deposito sebelum jatuh tempo :&nbsp;&nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;a. Jika pencairan deposito dilakukan maksimal 7 hari kerja dari tanggal jatuh&nbsp; &nbsp;tempo&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1)&nbsp;Pinalty &nbsp;&nbsp;= 0 %</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2)&nbsp;Meterai = Rp.6.000,-</p><p>&nbsp; &nbsp; &nbsp; b. Jika pencairan deposito dilakukan melebihi batasan maksimal 7 hari kerja dari&nbsp;tanggal jatuh tempo dan bunga yang diterima adalah bunga standar</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1) Pinalty = 0,25 % dari pokok deposito atau minimal Rp. 20.000,-</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2) Meterai = Rp. 6.000,-</p><p>&nbsp; &nbsp; &nbsp; c. Jika pencairan deposito dilakukan melebihi batasan maksimal 7 hari kerja dari tanggal jatuh tempo dan bunga yang diterima adalah bunga special</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1) Pinalty = 0,5 % dari pokok deposito atau minimal Rp. 50.000,-</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2) Meterai = Rp. 6.000,-</p><p><strong><em>*Pencairan Deposito diluar ketentuan diatas dan dengan alasan tertentu (Biaya &nbsp;Rumah Sakit atau Biaya Pendidikan) akan ditinjau kasus per kasus oleh Pimpinan.</em></strong></p>', '1', '1', '0', '20180125112813_deposito.png');
INSERT INTO `sub_produk` VALUES ('6', '1', 'ATM Tabungan Surya', '<p>ATM Tabungan Surya adalah produk tabungan berkualitas yang dikelola secara profesional, aman, terpercaya, memiliki berbagai keuntungan dan praktis. Dengan <em>feature</em> baru BSY ini, pemasaran produk simpanan di BSY akan semakin marak karena adanya</p>', '<p><strong>Ketentuan:</strong></p><p>1.&nbsp;&nbsp;&nbsp;&nbsp; Setoran awal minimal Rp. 25.000,-</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Setoran selanjutnya minimal Rp. 10.000,-</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Saldo pengendapan tabungan minimal Rp. 25.000,-</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Biaya penutupan rekening Rp. 10.000,-</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Tidak diasuransikan.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Diikutsertakan undian berhadiah.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Biaya :</p><ol><li>Kartu ATM Baru&nbsp;&nbsp;Rp. 6.000,-</li><li>Administrasi bulanan ATM Tabungan Surya Umum&nbsp;&nbsp;Rp. 5.000,-</li><li>Administrasi bulanan ATM Tabungan Surya Khusus&nbsp;Rp. 2.000,-</li></ol>', '5', '1', '0', '20180125112536_atm.png');
INSERT INTO `sub_produk` VALUES ('7', '1', 'ATM Khusus', '<p>Tabungan ATM Khusus yaitu tabungan yang dikhususkan untuk karyawan/ti BPR Bank Surya Yudha sebagai rekening penampungan gaji.</p>', '', '4', '1', '0', '20180209173907_atm.png');
INSERT INTO `sub_produk` VALUES ('8', '1', 'Tabungan Hari Tua Umum', '<p>Tabungan Hari Tua Umum adalah Tabungan investasi jangka panjang untuk dengan jangka waktu selama 5 tahun yang dikelola secara profesional, aman, terpercaya, menguntungkan dan praktis untuk merencanakan masa depan Anda.</p>', '<p><strong>TABUNGAN HARI TUA (THT) UMUM :</strong></p><p>1. Setoran awal minimal Rp. 100.000,-</p><p>2. Setoran selanjutnya minimal Rp. 100.000,-</p><p>3. Biaya penutupan rekening Rp. 25.000,-</p><p>4. Tanpa biaya administrasi bulanan.</p><p>5. Berlaku untuk nasabah umum, Pegawai Negeri Sipil dan Pegawai Swasta baik yang sudah melakukan kerja sama dengan BPR Bank Surya Yudha ataupun belum.</p><p>6. Jangka waktu kontrak 5 tahun.</p><p>7. Diasuransikan, dengan usia maksimal 64 tahun pada saat pembukaan rekening.</p><p>8. Apabila nasabah meninggal dunia pada saat jangka waktu kontrak belum berakhir, maka tabungan akan diberikan kepada ahli waris dengan jumlah total sampai dengan periode kontrak.</p><p>9. Setoran dapat dilakukan secara langsung atau melalui potong gaji karyawan.</p><p>10. Tidak dapat diambil sewaktu-waktu, hanya dapat diambil pada saat jatuh tempo atau pada saat karyawan telah pensiun yang harus disertai dengan surat rekomendasi dari dinas/perusahaan terkait.</p><p>11. Tidak bisa dipindahtangankan.</p><p>12. Diikutsertakan undian berhadiah.</p>', '6', '1', '0', '20180125112250_tht.png');
INSERT INTO `sub_produk` VALUES ('9', '1', 'Tabungan Umroh', '<p>Tabungan Umroh merupakan pengembangan produk simpanan tabungan yang akan membantu para nasabah mewujudkan impian untuk berangkat beribadah Umroh. Dengan diluncurkannya tabungan umroh, diharapkan nantinya dapat membantu dalam pencapaian target simpanan ', '<p><strong>Ketentuan:</strong></p><p>1.&nbsp;&nbsp;&nbsp;&nbsp; Tabungan hanya dapat dibuka oleh perorangan dan tanpa uang muka.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Setoran awal&nbsp; dan selanjutnya sesuai dengan kriteria jangka waktu yang dipilih.</p><p>&nbsp;</p><p><strong>Jangka Waktu</strong></p><p><strong>Nominal Setoran Awal &amp; Selanjutnya</strong></p><p>1 (satu) tahun</p><p>Rp. 2.500.000,-/bulan</p><p>2 (dua) tahun</p><p>Rp. 1.250..000,-/bulan</p><p>3 (tiga) tahun</p><p>Rp.&nbsp; 850.000,-/bulan</p><p>4 (empat) tahun</p><p>Rp.&nbsp; 625.000,-/bulan</p><p>5 (lima) tahun</p><p>Rp.&nbsp; 500.000,-/bulan</p><p>&nbsp;</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Pada saat pembukaan rekening akan mendapatkan hadiah langsung berupa buku doa dan souvenir.</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Menjelang keberangkatan umroh akan mendapatkan fasilitas berupa:</p><p>a.&nbsp;&nbsp;&nbsp;&nbsp; Mukena/sarung</p><p>b.&nbsp;&nbsp;&nbsp;&nbsp; Tas slempang</p><p>c.&nbsp;&nbsp;&nbsp;&nbsp; Travel bag/tas punggung</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Tabungan tidak dapat diambil sewaktu-waktu dan hanya dapat diambil apabila jatuh tempo.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Tanpa dikenakan biaya administrasi bulanan.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Biaya penutupan rekening Rp. 25.000,-</p><p>8.&nbsp;&nbsp;&nbsp;&nbsp; Administrasi penggantian buku&nbsp; hilang, habis, cacat/rusaknya buku tabungan akan dikenakan biaya sebesar Rp. 5.000,-</p><p>9.&nbsp;&nbsp;&nbsp;&nbsp; Diasuransikan, sehingga apabila penabung meninggal dunia maka ahli waris yang ditunjuk dapat menggantikan umroh tanpa melanjutkan setoran sampai lunas.</p><p>10.&nbsp; Dijamin asuransi dengan batasan maksimal usia 64 tahun saat melakukan pembukaan rekening, sedangkan usia &gt; 64 tahun tidak dicover asuransi.</p><p>11.&nbsp; Apabila nasabah ditengah perjalanan dalam menabung memiliki dana dan akan melaksanakan umroh, maka dana yang ada harus disetor terlebih dahulu ke rekening tabungan dan perusahaan akan mengurus ke travel agent untuk pemberangkatannya.&nbsp;</p><p>12.&nbsp; Apabila dana dalam rekening tabungan yang sudah ada masih terdapat kekurangan yang disebabkan karena kenaikkan tarif umroh, maka peserta harus menambah kekurangan tersebut maksimal 1 (satu) bulan sebelum keberangkatan dan penambahan dana tersebut ditransaksikan melalui rekening tabungan.</p><p>13.&nbsp; Apabila pada saat menjelang keberangkatan terdapat kelebihan dana, maka akan dikembalikan dalam bentuk uang saku.</p><p>Tidak diikutsertakan undian berhadiah.</p>', '6', '1', '0', '20180125112644_umroh.png');
INSERT INTO `sub_produk` VALUES ('10', '1', 'Tabungan Arisan Surya', '<p>Pemasaran produk ini ideal untuk dilakukan di kalangan kelompok, baik kelompok organisasi, instansi maupun kelompok arisan dan paguyuban. Secara berkesinambungan akan meningkatkan lagi untuk melakukan penambahan jumlah kelompok Tabungan Arisan Surya (T', '<p><strong>Ketentuan:</strong></p><p>1.&nbsp;&nbsp;&nbsp;&nbsp; Jumlah peserta Tabungan Arisan Surya disesuaikan dengan kriteria masing-masing kelompok.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Jangka waktu pelaksanaan 36 Bulan.</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Peserta yang menang kocokan Tabungan Arisan Surya akan mendapatkan hadiah berupa uang tunai dan besarnya ditentukan sesuai dengan kriteria kelompok masing-masing dan langsung dikreditkan ke rekening Tabungan Arisan Surya pemenang dan dinyatakan keluar dari kepesertaan Tabungan Arisan Surya.</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Saldo Tabungan Arisan Surya akan ditutup dan dialihkan ke Tabungan Surya pemenang.</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Setoran awal minimal harus sesuai dengan kriteria pada saat mengikuti kepesertaan Tabungan Arisan Surya.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Setoran selanjutnya sesuai dengan kriteria awal pada saat mengikuti kepesertaan Tabungan Arisan Surya.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Biaya penutupan rekening&nbsp; Rp. 10.000,-</p><p>8.&nbsp;&nbsp;&nbsp;&nbsp; Tidak diasuransikan.</p><p>9.&nbsp;&nbsp;&nbsp;&nbsp; Tidak diikutsertakan undian berhadiah.</p>', '7', '1', '0', '20180125112346_tas.png');
INSERT INTO `sub_produk` VALUES ('11', '1', 'Tabungan SimPel', '<p>SimPel adalah tabungan untuk siswa yang diterbitkan secara nasional oleh bank-bank di Indonesia dengan persyaratan mudah dan sederhana serta fitur yang menarik, dalam rangka edukasi dan inklusi keuangan untuk mendorong budaya menabung sejak dini. Penge</p>', '<p>Ketentuan:</p><p>1.&nbsp;&nbsp; Merupakan tabungan perorangan untuk siswa warga negara indonesia baik PAUD, TK, SD, SMP, SMA, Madrasah (MI, MTs, MA) atau sederajat, yang berusia dibawah 17 tahun dan belum memiliki kartu identitas.</p><p>2.&nbsp;&nbsp; Setoran awal pembukaan rekening minimum Rp. 5.000,-</p><p>3.&nbsp;&nbsp; Setoran selanjutnya minimum Rp. 1.000,-</p><p>4.&nbsp;&nbsp; Saldo minimum rekening Rp. 5.000,-</p><p>5.&nbsp;&nbsp; Jumlah maksimal penarikan Rp. 250.000,- per penarikan yang bisa dilayani di sekolah, kecuali pada saat nasabah akan menutup rekening. Penarikan diatas Rp. 250.000,- hanya dapat dilayani di Kantor BPR Bank Surya Yudha terdekat</p><p>6.&nbsp;&nbsp; Frekuensi penarikan yang dapat dilayani di sekolah maksimal 2 kali transaksi dalam 1 bulan. Sedangkan penarikan yang melebihi dari 2 kali transaksi dalam 1 bulan hanya dapat dilayani di bank.</p><p>7.&nbsp;&nbsp; Penarikan tabungan harus dilakukan oleh penabung sendiri dengan menunjukkan buku tabungan kepada petugas bank. Apabila penarikan tunai dilakukan oleh bukan penabung sendiri harus dilengkapi dengan Surat Kuasa yang sah dan bermeterai cukup serta dilampiri dengan foto copy identitas pemberi kuasa dan penerima kuasa.</p><p>8.&nbsp;&nbsp; Penarikan yang dilakukan oleh penabung harus melalui pihak sekolah dan harus diketahui oleh pihak yang mewakili dari sekolah.</p><p>9.&nbsp;&nbsp; Sebagai bukti tabungan, bank akan menerbitkan buku tabungan atas nama penabung (siswa).</p><p>10.Satu siswa hanya diperkenankan memiliki 1 (satu) rekening SimPel di 1 (satu) bank yang sama.</p><p>11.Tidak diperkenankan untuk rekening bersama (<em>joint account</em>).</p><p>12.Segala penyalahgunaan dalam bentuk apapun termasuk hilangnya buku tabungan, menjadi tanggung jawab sepenuhnya penabung.</p><p>13.Tidak dikenakan biaya administrasi bulanan.</p><p>14.Rekening yang tidak ada transaksi selama 12 (dua belas) bulan berturut-turut, maka akan dikenakan biaya administrasi sebesar Rp. 1.000,- per bulan.</p><p>15.Apabila saldo dibawah saldo minimum, maka rekening akan ditutup oleh sistem dengan biaya penutupan rekening sebesar sisa saldo.</p><p>16.Biaya penutupan rekening atas permintaan nasabah Rp. 5.000,-</p><p>17.Tidak mendapatkan bunga tetapi akan diganti dengan program reward.</p><p>18.Tidak diikutsertakan undian berhadiah.</p>', '8', '1', '0', '20180209151753_Tabungan_simpel.png');
INSERT INTO `sub_produk` VALUES ('12', '2', 'Deposito Karyawan ', '<p>Deposito khusus diperuntukkan bagi karyawan/ti BPR Bank Surya Yudha dengan ketentuan yang sama dengan deposito umum namun perlakuan suku bunga yang diatur berbeda dengan deposito umum.</p>', '', '2', '1', '0', '20180209174119_deposito.png');
INSERT INTO `sub_produk` VALUES ('13', '2', 'Deposito Berhadiah ', '<p>Deposito berhadiah adalah inovasi dari produk dari Deposito Berjangka, dengan ketentuan suku bunga 1% dibawah suku bunga deposito standar (<em>counter rate</em>), dan perhitungan suku bunga deposito pada bilyet minimal 0,05%. Nasabah bebas memilih hadiah, setoran dan jangka waktu yang disepakati.</p>', '', '4', '1', '0', '20180209174212_deposito.png');
INSERT INTO `sub_produk` VALUES ('14', '3', 'Kredit Umum ', '<p>Kredit Umum adalah kredit yang diberikan untuk pembiayaan modal kerja guna menambah modal usaha, pembiayaan investasi untuk pembelian sarana dan prasarana usaha dan pembiayaan untuk konsumsi (pendidikan, kepemilikan rumah pribadi, pembelian alat-alat elektronik, dll</p>', '<p>1. Fotocopy Kartu Identitas (KTP/SIM suami/istri/pendamping yang masih berlaku)</p><p>2. Fotocopy Kartu Keluarga (KK)</p><p>3. Izin-izin usaha yang berlaku</p><p>4. Fotocopy Agunan (sertifikat Hak Milik (SHM), SHGB, BPKB, Hak pakai Kios/Los/Bangsal,dll)</p>', '1', '1', '0', '20180212160219_kreditumum.png');
INSERT INTO `sub_produk` VALUES ('15', '3', 'Kredit Pegawai', '<p>Kredit Pegawai adalah kredit yang diberikan bagi Pegawai Negeri dan Pegawai Swasta yang berpenghasilan tetap.</p>', '<p>1. Fotocopy Kartu Identitas (KTP/SIM suami/istri/pendamping yang masih berlaku)</p><p>2. Fotocopy Kartu&nbsp;Kluarga (KK)</p><p>3. Fotocopy SK CPNS, SK Pertama, SK Terakhir, Karpeg, Taspen</p><p>4. Rincian gaji terakhir yang disahkan oleh Bendahara dan Kepala Dinas</p><p>5. Surat Kuasa potongan Gaji yang disahkan oleh Bendahara dan Kepala Dinas</p>', '2', '1', '0', '20180212160240_Kredit_pegawai.png');
INSERT INTO `sub_produk` VALUES ('16', '3', 'Kredit Kendaraan ', '<p>Kredit Kendaraan adalah sebuah fasilitas pinjaman kepemilikan kendaraan bermotor yang diberikan oleh pihak BPR Bank Surya Yudha untuk masyarakat umum maupun pegawai.</p>', '<p>1. Fotocopy Kartu Identitas (KTP/SIM suami/istri/pendamping yang masih berlaku</p><p>2. Fotocopy Kartu Keluarga (KK)</p><p>3. Melayani pembelian segala merk kendaraan</p><p>4. Dijamin Asuransi</p>', '3', '1', '0', '20180212160300_Kredit_Kendaraan.png');
INSERT INTO `sub_produk` VALUES ('17', '1', 'TabunganKu', '<p>Tabungan yang diselenggarakan secara bersama oleh bank-bank di Indonesia guna menumbuhkan budaya menabung serta untuk meningkatkan kesejahteraan masyarakat. Produk ini ditujukan sebagai produk tabungan yang sangat ideal dipasarkan untuk kalangan pelaja</p>', '<p><strong>Ketenuan:</strong></p><p>1.&nbsp;&nbsp;&nbsp;&nbsp; Setoran awal minimal Rp. 10.000,-</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp; Setoran selanjutnya tidak ada batasan.</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp; Saldo minimum rekening setelah penarikan Rp. 10.000,-</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp; Jumlah minimum penarikan di Konter sebesar Rp. 50.000,-kecuali pada saat nasabah ingin menutup rekening.</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp; Rekening yang tidak ada transaksi selama 6 (enam) bulan berturut-turut, maka akan dikenakan biaya pinalty sebesar Rp. 1.000,- per bulan.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp; Biaya penutupan rekening atas permintaan nasabah Rp. 5.000,-</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp; Tidak diasuransikan.</p><p>8.&nbsp;&nbsp;&nbsp;&nbsp; Tidak diikutsertakan undian berhadiah.</p>', '9', '1', '0', '20180209152642_Tabunganku.png');
