INSERT INTO `sub_produk` VALUES ('36', '4', 'Pembayaran', '<p>Layanan PPOB (Payment Point Online Bank) BSY untuk solusi pembayaran yang mudah dan cepat. Anda dapat dengan mudah membayar tagihan dengan sekali cara. Tagihan yang dapat dibayarkan melalui PPOB BSY antara lain :</p><p>1.&nbsp;Listrik:</p><p>a)&nbsp;PLN Postpaid</p><p>b)&nbsp;Non Tagihan Listrik (tambah daya, pemasangan daya baru)</p><p>&nbsp;</p><p>2.&nbsp;Langganan TV Berbayar:</p><p>a)&nbsp;Indovision</p><p>b)&nbsp;Orange TV</p><p>c)&nbsp;TelkomVision</p><p>d)&nbsp;Topas TV</p><p>e)&nbsp;Yes TV</p><p>f)&nbsp;Top TV</p><p>&nbsp;</p><p>3.&nbsp;Asuransi:</p><p>a)&nbsp;BPJS Kesehatan</p><p>b)&nbsp;BPJS Ketenagakerjaan</p><p>c)&nbsp;AJ Sinarmas</p><p>&nbsp;</p><p>4.&nbsp;Telkom:</p><p>a)&nbsp;Telkom PSTN</p><p>b)&nbsp;Kartu Hallo</p><p>c)&nbsp;Speedy</p><p>d)&nbsp;Indihome</p><p>&nbsp;</p><p>5.&nbsp;PDAM:</p><p>a)&nbsp;Banyumas</p><p>b)&nbsp;Banjarmasin</p><p>c)&nbsp;Cilacap</p><p>d)&nbsp;Palyjay</p><p>e)&nbsp;Aetra</p><p>f)&nbsp;Surabaya</p><p>g)&nbsp;Padang</p><p>h)&nbsp;Tirta Darma</p><p>i)&nbsp;Tirta Wijaya</p>', '', '2', '1', '0', '20180209174445_ppob.png');
