INSERT INTO `sub_produk` VALUES ('41', '1', 'Tabungan Pensiun', '<p>Tabungan khusus diberikan kepada karyawan/ti dipersiapkan untuk bekal di hari tua bila telah memasuki masa purna bakti/pensiun di PT. BPR Surya Yudhakencana.</p>', '<p>1.&nbsp;Tabungan khusus diberikan kepada karyawan/ti dipersiapkan untuk bekal di hari tua bila telah memasuki masa purna bakti/pensiun di PT. BPR Surya Yudhakencana.</p><p>2. Setoran awal minimal Rp. 25.000,-</p><p>3. Setoran selanjutnya minimal Rp 10.000,-</p><p>4. Saldo pengendapan tabungan minimal Rp 25.000,-</p><p>5. Biaya penutupan rekening Rp 10.000,-</p><p>6. Tanpa biaya administrasi bulanan</p><p>7. Tidak diasuransikan</p><p>8. Tidak disertakan undian berhadiah.</p>', '10', '1', '0', '20180303170511_tht.png');
INSERT INTO `sub_produk` VALUES ('42', '1', 'Tabungan Piknik Umum', '<p>Tabungan Piknik adalah inovasi tabungan terbaru dari BPR Bank Surya Yudha yang dikelola secara profesional, aman dan menguntungkan yang ditujukan untuk masyarakat umum. Tabungan ini dibuat berkelompok, dan pada saat periode selesai maka peserta tabungan ini akan mendapatkan :</p><p>1. Piknik Gratis</p><p>2. Pokok tabungan dan bunga</p><p>3. Grand Prize</p><p>4. Door Prize</p><p>5. Insentif</p>', '<p>1.&nbsp;&nbsp;Satu kelompok terdiri dari 200 peserta.</p><p>2.&nbsp;&nbsp;Pembukaan rekening dengan melampirkan fotocopy kartu identitas (KTP/SIM/KK/Paspor).</p><p>3.&nbsp;&nbsp;Setiap peserta melakukan setoran perdana sebesar Rp200.000,- dan ditransaksikan pada hari yang sama serta buku tabungan harus diberikan kepada nasabah.</p><p>4.&nbsp;&nbsp;Setoran setiap bulan Rp200.000,- dan dibayarkan maksimal pada tanggal 15 setiap bulannya.</p><p>5.&nbsp;&nbsp;Jangka waktu pelaksanaan 36 (tiga puluh enam) bulan.</p><p>6.&nbsp;&nbsp;Tabungan Piknik tidak dikenakan biaya administrasi bulanan, peserta hanya akan dikenakan biaya administrasi penutupan rekening sebesar Rp25.000,- <em>(dua puluh&nbsp;lima&nbsp;ribu rupiah) </em>pada saat periode Tabungan Piknik berakhir.</p><p>7.&nbsp;&nbsp;Bunga Tabungan Piknik dalam rekening 0,25% pertahun.</p><p>8.&nbsp;&nbsp;Tabungan Piknik dengan total biaya dana sebesar 6 % pertahun.</p><p>9.&nbsp;&nbsp;Setelah Tabungan Piknik jatuh tempo, maka saldo tabungan beserta bunga bisa diambil secara utuh dan tabungan secara otomatis ditutup.&nbsp;&nbsp;</p><p>10.&nbsp;Pada akhir periode,&nbsp;semua peserta yang setorannya lancar akan mendapatkan fasilitas :</p><p>a.&nbsp;Piknik gratis dari Bank Surya Yudha</p><p>b.&nbsp;Grand Prize berupa :</p><p>- Pemenang 1 Rp1.000.000,-</p><p>- Pemenang 2 Rp&nbsp;&nbsp;750.000,-</p><p>- Pemenang 3 Rp&nbsp;&nbsp;600.000,-</p><p>c.&nbsp;Door Prize untuk 25 pemenang @ Rp500.000,-</p><p>d.&nbsp;Insentif @ Rp100.000,- bagi yang tidak mendapatkan Grand Prize maupun Door Prize</p><p>Catatan :</p><p>1)&nbsp;Door Prize dan Grand Prize hanya akan diundi bagi peserta yang lancar dan tidak pernah memiliki tunggakan.</p><p>2)&nbsp;Piknik diberikan bagi seluruh peserta yang setorannya sudah genap 36 bulan, dengan ketentuan hanya berlaku bagi peserta yang memiliki tunggakan paling banyak 3 (tiga) bulan. Dan bagi peserta yang memiliki tunggakan, maka pada bulan berikutnya tunggakan tersebut harus lunas.s.</p><p>11.&nbsp;Peserta piknik yang sudah memenuhi syarat-syarat pada poin 10, dan tidak bisa ikut piknik maka peserta akan mendapatkan insentif dan uang ganti piknik dengan total sebesar Rp250.000,-.</p><p>12.&nbsp;1 (satu) rekening berlaku untuk satu orang&nbsp;peserta piknik.&nbsp;&nbsp;&nbsp;</p><p>13.&nbsp;Apabila peserta tidak dapat melanjutkan kepesertaan Tabungan Piknik, maka peserta dapat mengalihkan kepesertaan kepada pihak lain dengan sepengetahuan Bank.</p><p>14.&nbsp;Apabila peserta tidak dapat mengikuti piknik yang diadakan oleh pihak Bank, maka piknik bisa diwakilkan kepada orang lain.</p><p>15.&nbsp;Apabila peserta tidak dapat mengalihkan dan melanjutkan kepesertaan Tabungan piknik, maka setoran Tabungan Piknik baru dapat diambil setelah periode tabungan berakhir.</p><p>16.&nbsp;Penarikan Tabungan Piknik dapat dilakukan secara tunai maupun pemindahbukuan melalui rekening Tabungan Surya.</p><p>17.&nbsp;Grand Prize, Door Prize, dan Insentif diberikan melalui pemindahbukuan melalui rekening Tabungan Piknik.</p><p>&nbsp;</p>', '11', '1', '0', '20180725123658_Ikon_Piknik.png');
INSERT INTO `sub_produk` VALUES ('43', '1', 'Tabungan Piknik Sekolah Dasar', '<p>Tabungan Piknik adalah inovasi tabungan terbaru dari BPR Bank Surya Yudha yang dikelola secara profesional, aman dan menguntungkan yang ditujukan untuk anak Sekolah Dasar. Tabungan ini dibuat berkelompok, dan pada saat periode selesai maka peserta tabungan ini akan mendapatkan :</p><p>1. Piknik Gratis</p><p>2. Pokok tabungan dan bunga</p><p>3. Grand Prize</p><p>4. Door Prize</p><p>5. Insentif</p>', '<p>1.&nbsp;Satu kelompok terdiri dari 100 peserta.</p><p>2.&nbsp;Pembukaan rekening dengan melampirkan fotocopy KIA/KK/Kartu Pelajar/Paspor.</p><p>3.&nbsp;Setiap peserta melakukan setoran perdana sebesar Rp75.000,-&nbsp;dan ditransaksikan pada hari yang sama serta buku tabungan harus diberikan kepada nasabah.&nbsp;</p><p>4.&nbsp;Setoran setiap bulan Rp75.000,- dan dibayarkan maksimal pada tanggal 15 setiap bulannya.</p><p>5.&nbsp;Jangka waktu pelaksanaan 60&nbsp;(enam&nbsp;puluh ) bulan.</p><p>6.&nbsp;Tabungan Piknik tidak dikenakan biaya administrasi bulanan, peserta hanya akan dikenakan biaya administrasi penutupan rekening sebesar Rp25.000,- <em>(</em><em>dua </em><em>puluh </em><em>lima </em><em>ribu rupiah) </em>pada saat periode Tabungan Piknik berakhir.</p><p>7.&nbsp;Bunga Tabungan Piknik dalam rekening 0,25% pertahun.</p><p>8.&nbsp;Tabungan Piknik dengan total biaya dana sebesar 6 % pertahun.</p><p>9.&nbsp;Setelah Tabungan Piknik jatuh tempo, maka saldo tabungan beserta bunga bisa diambil secara utuh dan tabungan secara otomatis ditutup.&nbsp;&nbsp;</p><p>10.&nbsp;Pada akhir periode, semua peserta yang setorannya lancar akan mendapatkan fasilitas :</p><p>a.&nbsp;Piknik gratis dari Bank Surya Yudha.</p><p>b.&nbsp;Grand&nbsp;Prize berupa :</p><p>- Pemenang 1 Rp350.000,-</p><p>- Pemenang 2 Rp300.000,-</p><p>- Pemenang 3 Rp250.000,-</p><p>c.&nbsp;Doorprize untuk 20 pemenang @ Rp200.000,-</p><p>d.&nbsp;Insentif @ Rp50.000,- bagi yang tidak mendapatkan Grand Prize maupun Door Prize.</p><p>Catatan :</p><p>1)&nbsp;Door Prize dan Grand Prize hanya akan diundi bagi peserta yang lancar dan tidak&nbsp;pernah memiliki tunggakan.</p><p>2)&nbsp;Piknik diberikan bagi seluruh peserta yang setorannya sudah genap 60 bulan,&nbsp;dengan ketentuan hanya berlaku bagi peserta yang memiliki tunggakan paling banyak 3 (tiga) bulan. Dan bagi peserta yang memiliki tunggakan, maka pada bulan berikutnya tunggakan tersebut harus lunas.</p><p>11.&nbsp;Peserta piknik yang sudah memenuhi syarat-syarat pada poin 10, dan tidak bisa ikut piknik maka peserta akan mendapatkan insentif dan uang ganti piknik dengan total sebesar Rp150.000,-.</p><p>12.&nbsp;1 (satu) rekening berlaku untuk satu orang&nbsp;peserta piknik.&nbsp;&nbsp;&nbsp;</p><p>13.&nbsp;Apabila peserta tidak dapat melanjutkan kepesertaan Tabungan Piknik, maka peserta dapat mengalihkan kepesertaan kepada pihak lain dengan sepengetahuan Bank.</p><p>14.&nbsp;Apabila peserta tidak dapat mengikuti piknik yang diadakan oleh pihak Bank, maka piknik bisa diwakilkan kepada orang lain.</p><p>15.&nbsp;Apabila peserta tidak dapat mengalihkan dan melanjutkan kepesertaan Tabungan piknik, maka setoran Tabungan Piknik baru dapat diambil setelah periode tabungan berakhir.</p><p>16.&nbsp;Penarikan Tabungan Piknik dapat dilakukan secara tunai maupun pemindahbukuan melalui rekening Tabungan Surya.</p><p>17.&nbsp;Grand Prize, Door Prize dan Insentif diberikan melalui pemindahbukuan rekening Tabungan Piknik.</p>', '12', '1', '0', '20180725124401_Ikon_Piknik.png');
